INSERT INTO `about` VALUES (10,'Flipit - was ist das?','<h3><strong>Auf zur Schn&auml;ppchenjagd!<img align=\"right\" alt=\"\" src=\"/public/br/images/upload/ckeditor/images/pig1(1).png\" style=\"width: 300px; height: 300px;\" /></strong></h3>\r\n\r\n<p>Bei Flipit bekommst du aktuelle Gutscheincodes f&uuml;r &Ouml;sterreich. Wir, die Flipit Redaktion, suchen t&auml;glich nach neuen Angeboten, Rabatten und Gutscheincodes speziell f&uuml;r &ouml;sterreichische Onlineshops. T&auml;glich kommen neue Gutscheine dazu. Einige unserer Codes sind exklusiv. Das bedeutet, dass du sie nur bei uns auf der Webseite findest. Viele dieser exklusiven Codes befinden sich in unserer Welt der Gutscheine. Diese kannst du kostenfrei betreten, indem du dich mit deiner E-Mail Adresse anmeldest.&nbsp;</p>\r\n\r\n<p>Zus&auml;tzlich zu den Gutscheincodes, geben wir dir Tipps, wie du in verschiedenen Situationen Geld sparen kannst. Diese findest du unter unseren Spartipps.&nbsp;</p>\r\n\r\n<p><a href=\"/at/anmeldung/step1\" onclick=\"showSignupPopup(null)\">&gt;&gt;&nbsp;Hier geht es zur Welt der Gutscheine!</a></p>\r\n\r\n<p>&nbsp;</p>\r\n',1,'2012-12-14 20:14:54','2013-10-22 12:56:14'),(11,'TÃ¤glich neue Codes','<h3><strong>T&auml;glich&nbsp;neue Gutscheincodes</strong></h3>\r\n\r\n<p>Jeden Tag stellt die Flipit.com Redaktion neue Gutscheincodes, Deals und Angebote f&uuml;r deine Lieblingsshops online. Wir profitieren bereits von diesen Rabatten f&uuml;r Elektronik, Fashion und vielem mehr. Du bekommst&nbsp;jetzt auch die&nbsp;Chance! Rabatte und Gutscheine f&uuml;r deine absoluten Lieblingsshops sind nur noch einen Mausklick entfernt.</p>\r\n\r\n<p>Such nach einem&nbsp;Onlineshop&nbsp;auf Flipit.com und informier dich &uuml;ber die verschiedenen Rabatte. Schaue jeden Tag einmal auf der Webseite vorbei, damit du perfekt bei deiner Online-Bestellung sparen kannst.</p>\r\n\r\n<p>&nbsp;</p>\r\n',1,'2012-12-28 16:28:00','2013-09-13 19:53:30'),(12,'Gutscheincodes - wie geht das?','<h3><strong>Was sind Gutscheincodes?</strong></h3>\r\n\r\n<p>Gutscheincodes im Internet sind die Alternative zu&nbsp;ausschneidbaren Coupons. Diese Coupons nutzt du zum Beispiel&nbsp;in einem Supermarkt oder Modegesch&auml;ft in deiner N&auml;he. Gutscheincodes gebrauchen dasselbe&nbsp;Prinzip &ndash; jedoch&nbsp;online. Du schneidest keine Codes aus, sondern gehst ganz bequem auf Flipit.com &Ouml;sterreich und nutzt den Gutscheincode auf der jeweiligen Webseite des Onlineshops.</p>\r\n\r\n<h3><strong>Mehrere Arten von Gutscheincodes</strong></h3>\r\n\r\n<p>Wenn du einen Gutscheincode einl&ouml;st, erh&auml;ltst du Rabatte auf die verschiedensten Artikel. Nicht jeder Shop nennt diese Codes, Gutscheincodes. Viele Onlineshops verwenden&nbsp;Synonyme wie Rabattcode, Vorteilsnummer oder Gutschein-Code. Die Bedeutung ist jedoch die gleiche: Du erh&auml;ltst Rabatt auf deine Bestellung. Die folgenden Rabatte kommen am h&auml;ufigsten vor:</p>\r\n\r\n<ul>\r\n	<li>Ein Rabatt mit Mindestbestellwert (10% Rabatt auf Bestellungen ab 100&euro;)</li>\r\n	<li>Ein feststehender Betrag deines Gesamtwertes (50&euro; Rabatt auf einen Ausflug)</li>\r\n	<li>Ein Rabatt, der nur f&uuml;r bestimmte Produkte gilt (10% Rabatt auf alle Schuhe)</li>\r\n	<li>Kostenloser Versand (kostenloser Versand bis zum 1. August)</li>\r\n	<li>Ein feststehender Prozentsatz (10% Rabatt auf Computer)</li>\r\n</ul>\r\n',1,'2012-12-28 16:28:00','2013-10-21 20:49:50'),(13,'Spartipps','<h3><strong>Was sind&nbsp;Saving Guides?</strong></h3>\r\n\r\n<p>Wie schaffen es manche Leute immer und &uuml;berall Geld zu sparen? Fragst du dich das auch manchmal? Aus diesem Grund gibt es auf Flipit.com eine Auswahl an verschiedenen Saving Guides, in denen erkl&auml;rt wird, wie und wo man am besten Geld sparen kann. Auch ausgefallene Ideen, wie man mehr Geld verdienen kann geh&ouml;ren dazu.&nbsp;</p>\r\n\r\n<p>Damit man jedoch nicht auf Internetfallen reinf&auml;llt haben wir auch dazu einige Tipps und Tricks zusammengestellt. Nicht jeder vertraut dem Internet, doch dabei k&ouml;nnen wir helfen.</p>\r\n\r\n<h3><strong>Auch du kannst zu den Saving Guides beitragen</strong></h3>\r\n\r\n<p>Wenn du auch etwas zu unseren&nbsp;<a href=\"http://www.flipit.com/at/vorteil\">Saving Guides</a> beitragen m&ouml;chtest, dann schreib uns einfach eine&nbsp;<a href=\"http://www.flipit.com/at/info/kontakt\">E-Mail</a>.&nbsp;Jeder Tipp und Trick hilft, damit wir alle in Zukunft mehr Geld sparen k&ouml;nnen!</p>\r\n\r\n<p>&nbsp;</p>\r\n',1,'2012-12-28 16:28:00','2013-10-22 15:02:59'),(14,'Die Welt der Gutscheine','<h3><strong>Vorteile einer Mitgliedschaft</strong></h3>\r\n\r\n<p>Lukrativer und mit mehr Spa&szlig; l&auml;sst es sich sparen, wer sich entschlie&szlig;t Flipit.com Mitglied zu werden!</p>\r\n\r\n<p>Flipit.com Mitglieder erhalten exklusiven Zugang zu Gutscheincodes f&uuml;r verschiedene Onlineshops. Noch mehr in deinen Lieblingsshops sparen kannst du mit den Members Only Codes, die dir eine kostenlose Mitgliedschaft erm&ouml;glichen.</p>\r\n\r\n<p>Es wird stetig an mehr M&ouml;glichkeiten im Mitgliederbereich gearbeitet. So profitierst du nicht nur von exklusiven Codes, sondern bald auch von Extrafunktionen auf unserer Webseite. Eine kostenlose Mitgliedschaft lohnt sich also in jeder Hinsicht.</p>\r\n\r\n<h3><strong>Kostenlos&nbsp;Mitglied werden</strong></h3>\r\n\r\n<p>Wenn auch du Flipit.com Mitglied werden m&ouml;chtest, folge einfach dem untenstehenden Link, es&nbsp;kostet&nbsp;dich absolut nichts. Erstelle ganz einfach einen Account und schon werden die Members Only Codes auch f&uuml;r dich zug&auml;nglich.</p>\r\n\r\n<p><a href=\"/at/anmeldung/step1\" onclick=\"showSignupPopup(null)\">&gt;&gt;&nbsp;Erstelle jetzt deinen Account!</a></p>\r\n\r\n<p>&nbsp;</p>\r\n',1,'2013-10-21 20:48:50','2013-10-21 20:51:14');
