INSERT INTO `article_chapter` VALUES (135,1,'GÃ¼nstig reisen leicht gemacht','<p dir=\"ltr\" style=\"line-height:1.5;margin-top:0pt;margin-bottom:0pt;\">Der Alltag der meisten von uns kann ziemlich eint&ouml;nig werden. Da freut man sich auf den allj&auml;hrlichen Urlaub. Jedoch ist die Suche nach dem perfekten Reiseziel und vor allem nach dem passenden Preis f&uuml;r viele mehr eine Qual als eine Freude. Das Angebot ist riesig: Viele Reiseveranstalter locken mit g&uuml;nstigen Preisen. Doch welcher hat das beste Schn&auml;ppchen? Auch Seiten mit Gutscheincodes und Rabatten helfen uns da weiter. Wenn man einige leichte Tipps verfolgt, hat man die Suche schnell abgehakt und kann sich mit voller Vorfreude ans Kofferpacken machen.</p>\r\n','2013-10-28 19:11:48','2013-10-28 19:11:48'),(136,1,'1. Richtige Wahl des Reiseziels','<p dir=\"ltr\" style=\"line-height:1.5;margin-top:0pt;margin-bottom:0pt;\">Um dem Alltag zu entfliehen, braucht man einen v&ouml;lligen Tapetenwechsel. Denke auch nicht, dass der reine Strandurlaub der beste Weg ist, zu entspannen. Denn so entspannt dein K&ouml;rper, deine Gedanken kreisen wom&ouml;glich trotzdem noch um den Job und um allt&auml;gliche Sorgen. Was du da brauchst, ist ein guter Mix. Reise herum, entdecke die Region, mache etwas, was schon lange auf deiner Wunschliste steht. Wenn man da wei&szlig;, wonach das Herz sich sehnt, hat man schnell auch die Richtung, in die es gehen soll. Was dann wichtig ist, ist der Vergleich von Reiseveranstaltern. In &Ouml;sterreich ganz vorne mit dabei ist Hofer Reisen. Hier findest du St&auml;dte- und Kulturreisen, Autoreisen, Flugreisen, Rundreisen, Schiffsreisen und Busreisen. Die Auswahl ist also &uuml;berzeugend. Auf Seiten wie ab-in-den-urlaub.de vergleichst du auch gro&szlig;e Reiseveranstalter wie Hofer, Thomas Cook, Dertour, Neckermann und viele mehr. Der Vorteil dieser Seiten ist der direkte Vergleich. Du siehst direkt, welcher Veranstalter die ausgew&auml;hlte Reise g&uuml;nstiger anbietet und buchst somit den besten Preis. Auch Last Minute Angebote und Fr&uuml;hbucherrabatte k&ouml;nnen hier verglichen werden. Und wenn das nicht hilft, dann gibt es noch Gutscheinecodes und Rabatte, mit denen du sparen kannst.</p>\r\n','2013-10-28 19:11:48','2013-10-28 19:11:48'),(137,1,'2. Billige FlÃ¼ge finden','<p dir=\"ltr\" style=\"line-height:1.5;margin-top:0pt;margin-bottom:0pt;\">Wenn du nicht wirklich eine Reise planst, sondern einfach mal Familie oder Freunde besuchen m&ouml;chtest, reicht ein Flug ja v&ouml;llig aus. &nbsp;Auch die getrennte Buchung von Flug und Hotel f&uuml;r deinen Urlaub ist oft g&uuml;nstiger als ein Paket. Die besten Seiten hier sind swoodoo.at und checkfelix.com. Die Preise lassen sich so wunderbar vergleichen, und wenn man m&ouml;chte, kann man hier auch nach dem passenden Hotel schauen.</p>\r\n','2013-10-28 19:11:48','2013-10-28 19:11:48'),(138,1,'3. Das passende Hotel','<p>Was ist dir wichtig bei der Hotelwahl? Muss das Hotel eine gute Lage haben, eine gute Ausstattung, einen guten Preis? Oder am besten alles kombiniert? Ein gutes Hotel muss nicht gleich teuer sein. Trotzdem sollte man auch hier genau hinschauen. Hierbei helfen besonders Hotelbewertungen weiter. Denn wer kann das Hotel besser beurteilen als jemand, der bereits da war. Trivago und <a href=\"http://www.holidaycheck.de/\">Holidaycheck</a> helfen dir, das passende Hotel zu finden mithilfe der zahlreichen Bewertungen. So kann man sich ein genaueres Bild davon machen, was einen erwartet und gleichzeitig kann man auch Preise vergleichen, um so noch etwas zu sparen.</p>\r\n\r\n<p>Grunds&auml;tzlich l&auml;sst sich sagen, dass man besser fr&uuml;h als sp&auml;t bucht und mit den Tipps l&auml;sst sich auch beim Urlaub eine Menge Geld sparen.</p>\r\n','2013-10-28 19:11:48','2013-10-28 19:11:48'),(139,2,'Ausflugsziele jetzt gÃ¼nstiger genieÃŸen!','<p>Ein Ausflug an einem der Feiertage oder w&auml;hrend des&nbsp;Urlaubs bringt oft viele sch&ouml;ne Erinnerungen mit sich und bedeutet meist einen Tag lang Spa&szlig; und Freude. Der einzige Nachteil ist, dass solch ein Ausflug einige Kosten mit sich bringt. Viele Besucher nutzen aktuelle Angebote oder Gutscheine nicht, wodurch sie in einem Freizeitpark oder Tierpark unn&ouml;tig viel Geld bezahlen. Neben einem Ausflug in einen Erlebnispark gibt es nat&uuml;rlich noch andere Ausflugsm&ouml;glichkeiten, wie ein romantisches Wochenende in eine&nbsp;der sch&ouml;nsten St&auml;dte &Ouml;sterreichs. Halt die Augen offen f&uuml;r&nbsp;gute&nbsp;Angebote&nbsp;und sch&ouml;ne&nbsp;Pl&auml;tze, bei denen&nbsp;gespart werden kann!</p>\r\n','2013-10-28 19:13:41','2013-10-28 19:13:41'),(140,2,'Ausflug Erlebnispark','<p>In ganz &Ouml;sterreich gibt es eine Vielzahl an Erlebnisparks, Freizeitparks, Erlebnisb&auml;der, Tierparks und nat&uuml;rlich auch Kombinationen von diesen. So kann man zum Beispiel im Erlebnispark G&auml;nserndorf neben dem Waldklettergarten auch einen Streichelzoo besuchen. In den meisten der Erlebnisparks kann man den Vorteil von Gruppenrabatt nutzen, um so mit einer gro&szlig;en Familie oder zum Beispiel einer Schulklasse Geld zu sparen. Zu den sehr bekannten Freizeitparks in &Ouml;sterreich, zu denen wir auch oft Gutscheine haben, sind unter anderem Erlebnispark G&auml;nserndorf, Fantasiana Erlebnispark Strasswalchen, Erlebnisbad Attersee und Tierpark Haag. Auf diese Ausflugsziele kann man gut sparen, wenn man das Internet gut durchsucht. Auf Flipit.com haben wir viele Angebote zusammengestellt, um das Sparen einfacher zu machen. Oft ist zu beachten, dass die Tickets schon vor dem Besuch online bestellt werden m&uuml;ssen.</p>\r\n','2013-10-28 19:13:41','2013-10-28 19:13:41'),(141,2,'Andere Ausflugsziele in der Umgebung','<p>Neben Freizeitparks und Erlebnisparks gibt es nat&uuml;rlich auch andere sch&ouml;ne M&ouml;glichkeiten f&uuml;r einen Ausflug mit Kindern, der Familie oder dem Partner.</p>\r\n\r\n<h3>Ausflugsziele K&auml;rnten</h3>\r\n\r\n<p>Ein ganz bekanntes Ziel der Region K&auml;rnten ist wohl der W&ouml;rtersee. Aber auch der Faakersee und der Millst&auml;ttersee sind perfekt zum Baden. Wer lieber in die Natur m&ouml;chte, der besucht die Kindererlebniswelt Katschhausen. Die Granatschlucht Radenthein bietet einen Einblick in die Geschichte der Bergwerksleute. Besonders im Winter locken die Skipisten im K&auml;rnterland f&uuml;r viele Besucher und tolle Erlebnisse.</p>\r\n\r\n<h3>Salzburg</h3>\r\n\r\n<p>Salzburg hat einige Attraktionen zu bieten, wenn es um Freizeitaktivit&auml;ten geht. Die Stadt selbst ist eine Attraktion f&uuml;r sich. Ein tolles Ausflugsziel ist zum Beispiel der Tierpark Gut Aiderbichl, der &uuml;ber 1000 Tiere unterbringt. Die sehr bekannte Eisriesenwelt Werfen sollte man sich auf keinen Fall entgehen lassen. Diese ist einer der gr&ouml;&szlig;ten Eispal&auml;ste der Welt. In der Stadt selber gibt es unter anderem den Zauberfl&ouml;tenspielplatz und ein Marionettentheater, welche beide tolle Unterhaltung versprechen.</p>\r\n\r\n<h3>Ausflugsziele Steiermark</h3>\r\n\r\n<p>Die Steiermark ist die Gegend &Ouml;sterreichs, wenn es um Natur und viel gr&uuml;ner Landschaft geht. Die perfekte Gegend f&uuml;r Erholungsurlaub oder ein aufregender Ausflug mit der Familie, denn die Steiermark bietet alles. Neben einem Themenweg &ldquo;Wilde Wasser&rdquo; im Norden der Region, gibt es im S&uuml;den hingegen gibt es einen Dinosaurier Erlebnispark, Styriassic Park, in dem die Urtiere in lebensgro&szlig;er Form zu bestaunen sind. Auch die Hauptstadt der Region, Graz bietet viel Unterhaltung, unter anderem das Grazer Kasperltheater. Bekannt ist die Region auch f&uuml;r die vielen Thermen, wie zum Beispiel die H20-Therme in Bad Waltersdorf, die insbesondere sehr kinderfreundlich aufgebaut ist.</p>\r\n\r\n<h3>Ausflug Wien</h3>\r\n\r\n<p>Die Stadt Wien ist die gr&ouml;&szlig;te Stadt in &Ouml;sterreich und hat somit auch sehr viele Ausflugsziele und Freizeitangebote zu bieten f&uuml;r die gesamte Familie. Der Tiergarten Sch&ouml;nbrunn kann somit zum Beispiel ganzj&auml;hrlich besucht werden. Im Winter wie im Sommer gibt es eine Vielzahl&nbsp;verlockender Angebote, wie z.B. den Rodelh&uuml;gel im Wiener Prater und viele Badem&ouml;glichkeiten im Sommer.</p>\r\n\r\n<p>Hast du noch weitere Ideen f&uuml;r Ausfl&uuml;ge in &Ouml;sterreich, dann teile <span style=\"font-size: 14px;\">deinen Ausflugstipp&nbsp;</span>doch einfach mit uns und anderen.</p>\r\n','2013-10-28 19:13:41','2013-10-28 19:13:41'),(142,2,'Feiertage Ã–sterreich 2013','<p>F&uuml;r einen Ausflug gibt es verschiedenste Gelegenheiten. Sehr gut eignen sich da Feiertage und Festtage um einen Ausflug zu machen. Eine sehr gute Idee ist es auch einmal die Grenze zu &uuml;bertreten und an einem der Feiertage in &Ouml;sterreich einen Erlebnispark in Deutschland zu besuchen, damit man nicht den ganzen Tag in der Schlange stehen muss.</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width: 500px;\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Feiertage in &Ouml;sterreich</strong></td>\r\n			<td><strong>Tag</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><em><span itemprop=\"name\">Neujahr 2013</span></em></td>\r\n			<td><em>1. Januar 2013</em></td>\r\n		</tr>\r\n		<tr>\r\n			<td><em><span itemprop=\"name\">Heilige Drei K&ouml;nige 2013</span></em></td>\r\n			<td><em>6 Januar 2013</em></td>\r\n		</tr>\r\n		<tr>\r\n			<td><em><span itemprop=\"name\">St. Josef 2013</span></em></td>\r\n			<td><em>19 M&auml;rz 2013</em></td>\r\n		</tr>\r\n		<tr>\r\n			<td><em><span itemprop=\"name\">Karftreitag 2013</span></em></td>\r\n			<td><em>29 M&auml;rz 2013</em></td>\r\n		</tr>\r\n		<tr>\r\n			<td><em><span itemprop=\"name\">Ostermontag 2013</span></em></td>\r\n			<td><em>1 April 2013</em></td>\r\n		</tr>\r\n		<tr>\r\n			<td><em><span itemprop=\"name\">Staatsfeiertag 2013</span></em></td>\r\n			<td><em>1 Mai 2013</em></td>\r\n		</tr>\r\n		<tr>\r\n			<td><em><span itemprop=\"name\">St. Florian 2013</span></em></td>\r\n			<td><em>19 Mei 2013</em></td>\r\n		</tr>\r\n		<tr>\r\n			<td><em><span itemprop=\"name\">Christi Himmelfahrt 2013</span></em></td>\r\n			<td><em>9 Mai 2013</em></td>\r\n		</tr>\r\n		<tr>\r\n			<td><em><span itemprop=\"name\">Pfingstmontag 2013</span></em></td>\r\n			<td><em>9 Juni 2013</em></td>\r\n		</tr>\r\n		<tr>\r\n			<td><em><span itemprop=\"name\">Fronleichnam 2013</span></em></td>\r\n			<td><em>30 Mai 2013</em></td>\r\n		</tr>\r\n		<tr>\r\n			<td><em><span itemprop=\"name\">Mari&auml; Himmelfahrt 2013</span></em></td>\r\n			<td><em>15 August 2013</em></td>\r\n		</tr>\r\n		<tr>\r\n			<td><em><span itemprop=\"name\">Nationalfeiertag 2013</span></em></td>\r\n			<td><em>26 Oktober 2013</em></td>\r\n		</tr>\r\n		<tr>\r\n			<td><em><span itemprop=\"name\">Allerheiligen 2013</span></em></td>\r\n			<td><em>1 November 2013</em></td>\r\n		</tr>\r\n		<tr>\r\n			<td><em><span itemprop=\"name\">St. Leopold 2013</span></em></td>\r\n			<td><em>15 November 2013</em></td>\r\n		</tr>\r\n		<tr>\r\n			<td><em><span itemprop=\"name\">Mari&auml; Empf&auml;ngnis 2013</span></em></td>\r\n			<td><em>8 Dezember 2013</em></td>\r\n		</tr>\r\n		<tr>\r\n			<td><em><span itemprop=\"name\">Heiliger Abend 2013</span></em></td>\r\n			<td><em>24 Dezember 2013</em></td>\r\n		</tr>\r\n		<tr>\r\n			<td><em><span itemprop=\"name\">Weihnachten 2013</span></em></td>\r\n			<td><em>25 Dezember 2013</em></td>\r\n		</tr>\r\n		<tr>\r\n			<td><em><span itemprop=\"name\">Stefanitag 2013</span></em></td>\r\n			<td><em>26 Dezember 2013</em></td>\r\n		</tr>\r\n		<tr>\r\n			<td><em><span itemprop=\"name\">Silvester 2013</span></em></td>\r\n			<td><em>31 Dezember 2013</em></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n','2013-10-28 19:13:41','2013-10-28 19:13:41'),(147,3,'Vergleichsseiten - online sparen!','<p>Wie spart man eigentlich mit Vergleichsportalen? Bevor wir dieser Frage auf den Grund gehen, besch&auml;ftigen wir uns erst einmal mit der Frage, was eigentlich die Idee hinter Vergleichsportalen ist.</p>\r\n\r\n<h4>Definition Vergleichsportal</h4>\r\n\r\n<p>Ein Vergleichsportal ist eine Webseite, die Preise und Dienstleistungen miteinander vergleicht. Eine bestimmte Art des Vergleichsportals ist das Preisvergleichsportal. Mithilfe eines Rechners wird das g&uuml;nstigste Angebot f&uuml;r ein bestimmtes Produkt ermittelt.&nbsp;</p>\r\n','2013-10-29 15:06:40','2013-10-29 15:06:40'),(148,3,'Vergleichsportale nutzen','<p>​Viele Menschen nutzen Vergleichsseiten im Internet, wenn es um finanzielle Angelegenheiten geht (z.B. Hypotheken, Krankenversicherungen, Kredite). Die Portale bieten einen guten ersten Einblick in das bestehende Angebot.&nbsp;</p>\r\n\r\n<div class=\"box-grey\">\r\n<p>Die<em> </em>Seiten empfehlen dir einen der Anbieter. Das ist der Moment, in dem du dir einige Fragen stellen solltest:</p>\r\n\r\n<ol>\r\n	<li>\r\n	<div>Welche Dienste bietet die Seite an?</div>\r\n	</li>\r\n	<li>\r\n	<div>Wie verdient die Seite ihr Geld?</div>\r\n	</li>\r\n	<li>\r\n	<div>Wie ist dieser Vergleich zustande gekommen und ist dieser vollst&auml;ndig?</div>\r\n	</li>\r\n</ol>\r\n</div>\r\n\r\n<p>Um das Suchresultat des einen Vergleichsportals zu bekr&auml;ftigen, solltest du noch eine weitere unabh&auml;ngige Vergleichsseite zurate ziehen. Gib daf&uuml;r exakt die gleichen Sachen an, wie auf der ersten Seite. Ist das Ergebnis dasselbe, dann ist die Wahrscheinlichkeit gro&szlig;, dass du die richtige Entscheidung triffst.</p>\r\n\r\n<p>Vergleichsseiten k&ouml;nnen deine Wahl ein wenig beeinflussen und dir Produkte empfehlen, die f&uuml;r sie am lukrativsten sind. Der Anbieter, der die h&ouml;chste Provision zahlt zum Beispiel. Aus diesem Grund solltest du mehrere Vergleichsportale befragen.&nbsp;</p>\r\n','2013-10-29 15:06:40','2013-10-29 15:06:40'),(149,4,'Spare Geld durch geringeres Verschwenden von Wasser','<p>Durch die Anwendung dieser Wasserspartipps schonst du nicht nur die Umwelt, sondern auch den eigenen Geldbeutel. Wasser ist zwar relativ g&uuml;nstig in &Ouml;sterreich (durchschnittlich 2,17&euro; je Kubikliter Trinkwasser), trotzdem wirst du erstaunt sein, wie viel Wasser pro Haushalt jeden Tag verbraucht wird. Eine undichte Armatur kostet ca. 50&euro; extra im Jahr. Wenn es darum geht, Wasser zu sparen, k&ouml;nnen sehr kleine Ver&auml;nderungen einen gro&szlig;en Einfluss nehmen. Wir haben hier 100 Tipps aufgestellt, die dir helfen, tausende von Liter Wasser mit nur minimalem Aufwand zu sparen. Hast auch du gute Vorschl&auml;ge? Dann hinterlasse hier ein Kommentar und hilf den anderen Lesern!</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2013-10-29 15:08:21','2013-10-29 15:08:21'),(150,4,'KÃ¼che','<p>​<img alt=\"\" src=\"/public/be/images/upload/ckeditor/images/kitchen(1).jpg\" style=\"width: 100px; height: 100px; float: left;\" />​</p>\r\n\r\n<div style=\"display: block;\">\r\n<h3 style=\"color: rgb(204, 80, 88); font-style: italic;\">&nbsp; &nbsp;<strong>#1</strong> Sp&uuml;lst du per Hand ab? Dann lasse Wasser in eine Sch&uuml;ssel und sp&uuml;le in dieser.</h3>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong style=\"color: rgb(204, 80, 88); font-style: italic;\">#2 </strong>Eine moderne Geschirrsp&uuml;lmaschine ist in der Regel g&uuml;nstiger als der Abwasch von Hand.</p>\r\n\r\n<p><strong style=\"color: rgb(204, 80, 88); font-style: italic;\">#3 </strong>Hast du eine neue Sp&uuml;lmaschine, kannst du in der Regel eine k&uuml;rzere Reinigungszeit als vorgeschrieben einstellen, denn neue Modelle sp&uuml;len gr&uuml;ndlicher.</p>\r\n\r\n<p><strong style=\"color: rgb(204, 80, 88); font-style: italic;\">#4 </strong>Verwende ein Glas oder eine Flasche im Laufe des Tages, wenn du Wasser trinkst.</p>\r\n\r\n<p><strong style=\"color: rgb(204, 80, 88); font-style: italic;\">#5 </strong>Lasse T&ouml;pfe und Pfannen erst einweichen statt unter flie&szlig;endem Wasser zu schrubben.</p>\r\n\r\n<p><strong style=\"color: rgb(204, 80, 88); font-style: italic;\">#6 </strong>Wirf Obst und Gem&uuml;se auf den Kompost, statt in die Tonne. So sparst du indirekt eine Menge an Wasser.</p>\r\n\r\n<p><strong style=\"color: rgb(204, 80, 88); font-style: italic;\">#7 </strong>Wasche Obst und Gem&uuml;se in einem Topf mit warmem Wasser und nicht unter dem laufenden Wasserhahn.</p>\r\n\r\n<p><strong style=\"color: rgb(204, 80, 88); font-style: italic;\">#8 </strong>Taue Tiefk&uuml;hlkost nicht unter hei&szlig;em Leitungswasser auf, sondern lege diese fr&uuml;hzeitig in den K&uuml;hlschrank, dann taut sie von selbst.</p>\r\n\r\n<p><strong style=\"color: rgb(204, 80, 88); font-style: italic;\">#9 </strong>Setze einen Krug mit kaltem Wasser in den K&uuml;hlschrank, so&nbsp;wird kein Wasser verschwendet.</p>\r\n\r\n<p><strong style=\"color: rgb(204, 80, 88); font-style: italic;\">#10 </strong>Verwende Wasser erneut, um Lebensmittel aufzukochen oder zu d&uuml;nsten f&uuml;r eine leckere Suppe.</p>\r\n\r\n<p><strong style=\"color: rgb(204, 80, 88); font-style: italic;\">#11 </strong>W&auml;hle bewusst die richtige Topfgr&ouml;&szlig;e f&uuml;r das Gericht. Gro&szlig;e T&ouml;pfe ben&ouml;tigen mehr Wasser als in vielen F&auml;llen notwendig.</p>\r\n\r\n<p><strong style=\"color: rgb(204, 80, 88); font-style: italic;\">#12 </strong>Verwende so wenig Wasser wie m&ouml;glich zum Kochen. Dies hilft auch, den Stromverbrauch zu drosseln.</p>\r\n\r\n<p><strong style=\"color: rgb(204, 80, 88); font-style: italic;\">#13 </strong>Wenn dir Eisw&uuml;rfel auf den Boden fallen, dann verwende diese lieber f&uuml;r Pflanzen, als sie in der Sp&uuml;le zu entsorgen.</p>\r\n\r\n<p><strong style=\"color: rgb(204, 80, 88); font-style: italic;\">#14 </strong>Teller auskratzen statt absp&uuml;len, bevor sie in die Sp&uuml;lmaschine kommen.</p>\r\n\r\n<p><strong style=\"color: rgb(204, 80, 88); font-style: italic;\">#15 </strong>Setze einen Durchflussbegrenzer am Wasserhahn in der K&uuml;che ein.&nbsp;</p>\r\n\r\n<p><strong style=\"color: rgb(204, 80, 88); font-style: italic;\">#16 </strong>Gehe bewusst mit Fleisch um. Eine Kuh braucht 100 bis 150 Liter Wasser pro Tag!</p>\r\n\r\n<p><strong style=\"color: rgb(204, 80, 88); font-style: italic;\">#17 </strong>Sammle das Wasser, welches du verwendest, um Obst und Gem&uuml;se zu waschen, und gie&szlig;e damit deine Pflanzen.</p>\r\n\r\n<p>&nbsp;</p>\r\n','2013-10-29 15:08:21','2013-10-29 15:08:21'),(151,4,'Waschmaschine','<p>​​<img alt=\"\" src=\"/public/be/images/upload/ckeditor/images/wash.png\" style=\"width: 100px; height: 100px; float: left;\" /></p>\r\n\r\n<h3>&nbsp; &nbsp;​<strong style=\"color: rgb(82, 142, 153); font-style: italic;\">#18</strong><span style=\"color: rgb(82, 142, 153); font-style: italic;\"> Passe das Waschprogramm bewusst der Anzahl der zu waschenden Kleidung&nbsp;an.</span></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong style=\"color: rgb(82, 142, 153); font-style: italic;\">#19 </strong>Dunkle Kleidung in kaltem Wasser waschen spart Wasser und Energie und hilft zudem, die Farbe der Kleidungsst&uuml;cke zu erhalten.</p>\r\n\r\n<p><strong style=\"color: rgb(82, 142, 153); font-style: italic;\">#20 </strong>Vergleiche den Wasserverbrauch von Waschmaschinen beim Kauf eines neuen Ger&auml;tes.</p>\r\n\r\n<p><strong style=\"color: rgb(82, 142, 153); font-style: italic;\">#21 </strong>Verwende nicht die Funktion der zus&auml;tzlichen Reinigung der Maschine, wenn keine Hautallergien vorliegen.</p>\r\n\r\n<p><strong style=\"color: rgb(82, 142, 153); font-style: italic;\">#22 </strong>Wasche nicht, wenn die Waschmaschine erst halb voll ist.</p>\r\n\r\n<p><strong style=\"color: rgb(82, 142, 153); font-style: italic;\">#23 </strong>Verwende einen effizienten Duschkopf.</p>\r\n\r\n<p>&nbsp;</p>\r\n','2013-10-29 15:08:21','2013-10-29 15:08:21'),(152,4,'Badezimmer','<p>​​<img alt=\"\" src=\"/public/be/images/upload/ckeditor/images/bathroom.jpg\" style=\"width: 100px; height: 100px; float: left;\" />​ &nbsp;</p>\r\n\r\n<h3 style=\"color: rgb(237, 161, 30); font-style: italic;\">&nbsp; <strong>&nbsp;#24&nbsp;</strong>Duschst du nur ein oder zwei Minuten k&uuml;rzer, so kannst du bis zu 500 Liter Wasser pro Monat sparen.</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong style=\"color: rgb(237, 161, 30); font-style: italic;\">#25 </strong>Verwende einen Timer und dusche weniger als f&uuml;nf Minuten. Du sparst tausende von Litern Wasser pro Monat.</p>\r\n\r\n<p><strong style=\"color: rgb(237, 161, 30); font-style: italic;\">#26 </strong>F&uuml;lle Lebensmittelfarbe in den Tank der Toilette, so kannst du sehen, ob diese wirklich dicht ist.</p>\r\n\r\n<p><strong style=\"color: rgb(237, 161, 30); font-style: italic;\">#27 </strong>St&ouml;psle die Badewanne direkt zu und passe die Temperatur dann an, wenn die Wanne volll&auml;uft.</p>\r\n\r\n<p><strong style=\"color: rgb(237, 161, 30); font-style: italic;\">#28 </strong>Ersetze&nbsp;die WC-Dichtung sofort, wenn sie nicht mehr richtig schlie&szlig;t.</p>\r\n\r\n<p><strong style=\"color: rgb(237, 161, 30); font-style: italic;\">#29 </strong>Drehe den Wasserhahn beim Z&auml;hneputzen zu. Dies spart 180 Liter Wasser pro Woche.</p>\r\n\r\n<p><strong style=\"color: rgb(237, 161, 30); font-style: italic;\">#30 </strong>Mit einer WC-Doppelsp&uuml;lung kannst du eine Ersparnis von bis zu 15.000 Liter pro Jahr erzielen.</p>\r\n\r\n<p><strong style=\"color: rgb(237, 161, 30); font-style: italic;\">#31 </strong>St&ouml;psle das Sp&uuml;lbecken zu und schlie&szlig;e den Wasserhahn w&auml;hrend der Rasur. Das spart mehr als 1.000 Liter pro Monat.</p>\r\n\r\n<p><strong style=\"color: rgb(237, 161, 30); font-style: italic;\">#32 </strong>Mache das Wasser aus, wenn du dir die Haare w&auml;schst und spare so 500 Liter im Monat.</p>\r\n\r\n<p><strong style=\"color: rgb(237, 161, 30); font-style: italic;\">#33 </strong>Nimm eine schnelle Dusche statt einer Badewanne. Eine Badf&uuml;llung braucht etwa 250 Liter Wasser.</p>\r\n\r\n<p><strong style=\"color: rgb(237, 161, 30); font-style: italic;\">#34 </strong>Schmei&szlig;e nichts unn&ouml;tiges in die Toilette und nutze diese nicht als Aschenbecher oder Papierkorb.</p>\r\n\r\n<p><strong style=\"color: rgb(237, 161, 30); font-style: italic;\">#35 </strong>Meide undichte Stellen. Ein Tropfen pro Minute erh&ouml;ht den Verbrauch um 50 Liter Wasser pro Tag.</p>\r\n\r\n<p><strong style=\"color: rgb(237, 161, 30); font-style: italic;\">#36 </strong>Zusammen Duschen ist nicht nur viel sch&ouml;ner, es spart auch viel Wasser.</p>\r\n\r\n<p><strong style=\"color: rgb(237, 161, 30); font-style: italic;\">#37 </strong>Am Morgen in die Dusche pinkeln anstatt in die Toilette spart hunderte von Litern Wasser pro Monat.</p>\r\n\r\n<p><strong style=\"color: rgb(237, 161, 30); font-style: italic;\">#38 </strong>Ein Stopper f&uuml;r deine WC-Sp&uuml;lung kann hunderte von Litern pro Monat einsparen.</p>\r\n\r\n<p><strong style=\"color: rgb(237, 161, 30); font-style: italic;\">#39 </strong>Verwende ein Handtuch h&auml;ufiger als nur einmal.</p>\r\n\r\n<p><strong style=\"color: rgb(237, 161, 30); font-style: italic;\">#40 </strong>Sorge f&uuml;r eine gute Isolierung der Warmwasser-Rohre.</p>\r\n\r\n<p><strong style=\"color: rgb(237, 161, 30); font-style: italic;\">#41 </strong>Bringe deinen Kindern schon im fr&uuml;hen Alter bei, den Hahn sofort nach Gebrauch zu schlie&szlig;en.</p>\r\n\r\n<p>&nbsp;</p>\r\n','2013-10-29 15:08:21','2013-10-29 15:08:21'),(153,4,'Allgemein','<p>​​<img alt=\"\" src=\"/public/be/images/upload/ckeditor/images/algemeen.jpg\" style=\"width: 100px; height: 100px; float: left;\" />​</p>\r\n\r\n<h3 style=\"color: rgb(194, 103, 144); font-style: italic;\">&nbsp; &nbsp;<strong>#42&nbsp;</strong>Behalte den Wasserz&auml;hler und deine Rechnungen im Auge. So wird die undichte Stelle schnell entdeckt.</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong style=\"color: rgb(194, 103, 144); font-style: italic;\">#43 </strong>W&auml;hle eine Waschanlage, die Wasser recycelt.</p>\r\n\r\n<p><strong style=\"color: rgb(194, 103, 144); font-style: italic;\">#44 </strong>Vielleicht bist du zu Erm&auml;&szlig;igungen und Ausnahmen berechtigt. Schaue daf&uuml;r auf der zust&auml;ndigen Website.</p>\r\n\r\n<p><strong style=\"color: rgb(194, 103, 144); font-style: italic;\">#45 </strong>&nbsp;Achte auf undichte Stellen und repariere diese sofort. Der durchschnittliche Haushalt verschwendet 40 Liter pro Tag aufgrund eines Lecks.</p>\r\n\r\n<p><strong style=\"color: rgb(194, 103, 144); font-style: italic;\">#46 </strong> Verwende beim Waschen der H&auml;nde nur Wasser beim Absp&uuml;len der Seife.</p>\r\n\r\n<p><strong style=\"color: rgb(194, 103, 144); font-style: italic;\">#47 </strong>Belohne Kinder nach Einhalten der wassersparenden Ma&szlig;nahmen.</p>\r\n\r\n<p><strong style=\"color: rgb(194, 103, 144); font-style: italic;\">#48 </strong>Vermeide Spielsachen, die eine konstante Versorgung mit Wasser erfordern.</p>\r\n\r\n<p><strong style=\"color: rgb(194, 103, 144); font-style: italic;\">#49 </strong>Verwende auch Handt&uuml;cher in Hotels mehrmals.</p>\r\n\r\n<p><strong style=\"color: rgb(194, 103, 144); font-style: italic;\">#50 </strong>Sp&uuml;le nie gef&auml;hrliche Abf&auml;lle wie &Ouml;l, Medizin, Farbe und Terpentin runter, sondern entsorge diese separat, denn sie verunreinigen das Trinkwasser.</p>\r\n\r\n<p><strong style=\"color: rgb(194, 103, 144); font-style: italic;\">#51 </strong>W&auml;hle Wasserh&auml;hne , Duschk&ouml;pfe und andere Produkte mit einem niedrigen Verbrauch.</p>\r\n\r\n<p><strong style=\"color: rgb(194, 103, 144); font-style: italic;\">#52 </strong>Gute Waschmaschinen oder Geschirrsp&uuml;ler verringern deinen j&auml;hrlichen Verbrauch deutlich. Maschinen mit einem A-Siegel ben&ouml;tigen am wenigsten Energie.</p>\r\n\r\n<p><strong style=\"color: rgb(194, 103, 144); font-style: italic;\">#53 </strong>Verbrauche weniger Energie. Kraftwerke verbrauchen Millionen von Litern Wasser f&uuml;r die K&uuml;hlung. Durch die Einsparung von Energie, schl&auml;gst du zwei Fliegen mit einer Klappe.</p>\r\n\r\n<p><strong style=\"color: rgb(194, 103, 144); font-style: italic;\">#54 </strong>Mit einer Wasserpumpe lassen sich Lecks vermeiden. Bilden sich diese trotzdem, brauchst du eine gute Rohrzange.</p>\r\n\r\n<p><strong style=\"color: rgb(194, 103, 144); font-style: italic;\">#55 </strong>Nicht alle Pflanzen brauchen viel Wasser. W&auml;hle Pflanzen, die wenig oder kaum zus&auml;tzliches Wasser ben&ouml;tigen.</p>\r\n\r\n<p><strong style=\"color: rgb(194, 103, 144); font-style: italic;\">#56 </strong>Verwende por&ouml;se Materialien f&uuml;r Gehwege und Terrassen, damit das gesamte Regenwasser Pflanzen erreicht.</p>\r\n\r\n<p><strong style=\"color: rgb(194, 103, 144); font-style: italic;\">#57 </strong>Vermeide es, Rasen dort zu verlegen, wo die Wasserversorgung schwierig sein kann. Beachte Schr&auml;gen und Hindernisse, zum Beispiel auf dem B&uuml;rgersteig.</p>\r\n\r\n<p><strong style=\"color: rgb(194, 103, 144); font-style: italic;\">#58 </strong>F&uuml;ge eine Schicht von organischem Mulch &uuml;ber deine Pflanzen. Somit behalten diese ihre Feuchtigkeit und sind besser gesch&uuml;tzt vor Ungeziefer und direkter Sonne.</p>\r\n\r\n<p>&nbsp;</p>\r\n','2013-10-29 15:08:21','2013-10-29 15:08:21'),(154,4,'DrauÃŸen','<p>​​<img alt=\"\" src=\"/public/be/images/upload/ckeditor/images/garden.jpg\" style=\"width: 100px; height: 100px; float: left;\" />​</p>\r\n\r\n<h3 style=\"color: rgb(127, 145, 59); font-style: italic;\">&nbsp; &nbsp;<strong>#59 </strong>Gesammeltes Regenwasser kann in Tonnen gespeichert und f&uuml;r Pflanzen wiederverwertet werden.</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#60 </strong>M&auml;he den Rase nie zu kurz (3-5 cm). L&auml;ngere Graswurzeln sch&uuml;tzen vor Sonne und somit vor Austrocknung.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#61 </strong>Wenn du auf den Rasen trittst und das Gras Spuren hinterl&auml;sst, ist es Zeit, den Rasen zu bew&auml;ssern.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#62 </strong>Lasse den Rasen braun werden w&auml;hrend der Wintermonate. Brauner Rasen ben&ouml;tigt nur einmal in drei oder vier Wochen Wasser.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#63 </strong>Gem&auml;hter Rasen ist perfekt, um die Erde zu k&uuml;hlen und feucht zu halten. Lasse das abgeschnittene Gras einfach liegen!</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#64 </strong>Verlege den Garten nicht mit zu viel Winter-Gras. Weidelgras braucht t&auml;glich Wasser und Bermuda Gras nur einmal im Monat.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#65 </strong>Entferne regelm&auml;&szlig;ig Unkraut. Dieses nimmt den Pflanzen Wasser, Licht und N&auml;hrstoffe.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#66 </strong>D&uuml;nger f&ouml;rdert nicht nur das Pflanzenwachstum, sondern sorgt auch daf&uuml;r, dass sie mehr Wasser ben&ouml;tigen. Verwende dieses nur in minimaler Menge.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#67 </strong>Bew&auml;ssere deinen Garten im Sommer nur alle drei Tage.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#68 </strong>Verwende eine leere Thunfischdose um zu messen, wie viel Wasser die Sprinkleranlage abgibt. 2 bis 2,5cm Wasser ist mehr als genug.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#69 </strong>W&auml;hle die sonnigste Seite des Gartens f&uuml;r Pflanzen, die resistent gegen Trockenheit ist, wie zum Beispiel Distel, Lavendel oder Majoran.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#70 </strong>Vergiss nie, das Wasser im Garten abzudrehen. Ein Gartenschlauch kann bis zu 40 Liter Wasser pro Minute ablassen.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#71 </strong>Platziere den Rasensprenkler taktisch klug nach unten und stelle sicher, dass dieser den Garten <span style=\"font-size: 14px;\">bew&auml;ssert</span>. Der B&uuml;rgersteig und das Haus brauchen kein Wasser.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#72 </strong>Minimiere das Risiko der Verdampfung von Wasser und sprenkle den Rasen morgens oder abends, wenn es k&uuml;hler ist.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#73&nbsp;</strong>Finde heraus, wie die Hauptwasserleitung dicht gemacht wird, wenn es im Falle eines Ausfalls oder eines Lecks n&ouml;tig ist.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#74 </strong>Gib den Pflanzen nur Wasser, wenn sie es auch brauchen. Mehr Pflanzen sterben an zu viel als an zu wenig Wasser.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#75 </strong>Anzeichen daf&uuml;r, dass die Pflanzen zu viel Wasser haben, sind Verf&auml;rbungen der Bl&auml;tter zu einem helleren gr&uuml;n oder gelb und manchmal gar Schimmel- oder Algenbildung.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#76 </strong>Wenn du ein automatisches Bew&auml;sserungssystem hast, dann bringe einen Sensor an, der auch Regen in Betracht zieht und die Bew&auml;sserung daran anpasst.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#77 </strong>Bew&auml;ssere deinen Garten nicht bei starken Winden, denn das meiste Wasser wird sowieso verweht.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#78 </strong>Bew&auml;ssere Pflanzen mehr, jedoch seltener, um so tieferes Wurzelwachstum und bessere Resistenz gegen D&uuml;rre zu f&ouml;rdern.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#79 </strong>Nutze Sprinkler, die gr&ouml;&szlig;ere Tropfen Wasser nahe des Bodens abgeben. Kleine Tropfen verdampfen oft, bevor sie den Boden erreichen.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#80 </strong>Kaufe einen Regenwasserspeicher.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#81 </strong>Lege Eisw&uuml;rfel auf die Erde der H&auml;ngepflanzen, so haben diese auch einen k&uuml;hlen Schluck Wasser.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#82 </strong>Pr&uuml;fe Leitungen und Schl&auml;uche regelm&auml;&szlig;ig auf undichte Stellen.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#83 </strong>Mache ab und an einen R&uuml;ckschnitt, denn dieser sorgt nicht nur f&uuml;r ges&uuml;ndere Pflanzen und B&auml;ume, sondern verlangt auch weniger Wasser.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#84 </strong>Wenn du deinem Haustier frisches Wasser gibst, wirf das alte Wasser nicht weg, sondern gib es den Pflanzen.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#85 </strong>Wasche dein Haustier im Garten und zwar an einem Fleck, wo Pflanzen sind, die Wasser brauchen.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#86 </strong>Bew&auml;ssere die Pflanzen mit einer Gie&szlig;kanne und nicht mit dem Gartenschlauch.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#87 </strong>Hast du einen Pool im Garten, dann verzichte auf Brunnen und Wasserf&auml;lle. Diese f&uuml;hren dazu, dass mehr Wasser verdunstet.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#88 </strong>Verwende einen Besen statt einem Schlauch, um die Terrasse zu fegen.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#89 </strong>Ersetze &auml;ltere Toiletten durch neuere. Diese verbrauchen zu einem Drittel weniger Wasser.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#90 </strong>Entscheide dich f&uuml;r K&uuml;hlschr&auml;nke, die durch Luft anstatt durch Wasser gek&uuml;hlt werden.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#91 </strong>Hinterlasse an den Toiletten und Wasserh&auml;hnen eine Notfallnummer, sodass Mitarbeiter Lecks melden k&ouml;nnen.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#92 </strong>Kommuniziere bewusst monatlich den Wasserverbrauch an Mitarbeiter.</p>\r\n\r\n<p><strong style=\"color: rgb(127, 145, 59); font-style: italic;\">#93 </strong>Vergleiche bewusst vor dem Kauf den Verbrauch von Ger&auml;ten wie Eismaschinen, Geschirrsp&uuml;ler, K&uuml;hl- und Reinigungsanlagen.</p>\r\n\r\n<p>&nbsp;</p>\r\n','2013-10-29 15:08:21','2013-10-29 15:08:21'),(155,4,'Betrieb','<p>​​<img alt=\"\" src=\"/public/be/images/upload/ckeditor/images/office.jpg\" style=\"width: 100px; height: 100px; float: left;\" />​</p>\r\n\r\n<h3 style=\"color: rgb(243, 108, 65); font-style: italic;\">&nbsp; &nbsp;#94 Stelle das Wasser f&uuml;r die R&auml;ume im B&uuml;ro ab, in denen&nbsp;es nicht verwendet wird.</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong style=\"color: rgb(243, 108, 65); font-style: italic;\">#95 </strong>Stelle sicher, dass die effizientesten Bew&auml;sserungstechniken angewandt werden.</p>\r\n\r\n<p><strong style=\"color: rgb(243, 108, 65); font-style: italic;\">#96 </strong>Stelle eine Zeituhr f&uuml;r brunnenartige Anlagen im B&uuml;ro und lasse diese nur w&auml;hrend der Arbeitszeit laufen.</p>\r\n\r\n<p><strong style=\"color: rgb(243, 108, 65); font-style: italic;\">#97 </strong>Wasche&nbsp;Firmenwagen nur bei Waschanlagen, die Wasser recyceln.</p>\r\n\r\n<p><strong style=\"color: rgb(243, 108, 65); font-style: italic;\">#98 </strong>Wasche Firmenwagen nur bei Bedarf, anstatt nach einem Zeitplan.</p>\r\n\r\n<p><strong style=\"color: rgb(243, 108, 65); font-style: italic;\">#99 </strong>Wird das Aquarium gereinigt, so gib das alte Wasser den Pflanzen.</p>\r\n\r\n<p><strong style=\"color: rgb(243, 108, 65); font-style: italic;\">#100 </strong>Monatliche Kontrollen von Wasserleitungen und Armaturen vermeiden ungeahnte Kosten durch Wasserlecks.</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>Mit diesen Tipps kann der durchschnittliche &Ouml;sterreicher die Wasserverschwendung reduzieren. Das ist zwar bereits gut, jedoch gibt es nat&uuml;rlich viele weitere kreative M&ouml;glichkeiten, um Wasser zu sparen. Hast du noch weitere Tipps? Dann teile uns diese in den Kommentaren mit!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2013-10-29 15:08:21','2013-10-29 15:08:21'),(200,6,'Weihnachtszeit - Fluch oder Segen?','<p><em><strong>Weihnachtszeit</strong></em>&nbsp;-&nbsp;Dieses Wort l&ouml;st bei jedem etwas anderes aus. F&uuml;r viele ist es die sch&ouml;nste und besinnlichste&nbsp;Zeit des Jahres, die gemeinsam mit Familie&nbsp;und Freunden verbracht wird und dazu das ist, um endlich mal abzuschalten. F&uuml;r andere jedoch ist <em><strong>Weihnachten</strong></em>&nbsp;das Schreckenswort schlecht hin, bei dessen Klang einer sich am besten in einen 24-t&auml;gigen Winterschlaf begibt und erst dann wieder&nbsp;aufwacht, wenn der ganze Stress und Trubel ein Ende hat.&nbsp;Ich&nbsp;wage allerdings zu behaupten, dass die Prediger der letzten Kategorie&nbsp;definitiv&nbsp;Jahr f&uuml;r Jahr&nbsp;etwas Entscheidendes falsch machen,&nbsp;sei es bei&nbsp;der Vorbereitung, Umsetzung&nbsp;oder ganz einfach bei der Erwartungshaltung&nbsp;und Einstellung gegen&uuml;ber dem j&auml;hrlich wiederkehrenden&nbsp;Fest der Liebe und Besinnlichkeit. ABER -&nbsp;es w&auml;re doch schade, wenn diese Menschen niemals in den Genuss der eigentlich so sch&ouml;nen und ruhigen&nbsp;Weihnachtszeit kommen. Ich m&ouml;chte, dass Weihnachten 2013 das erste Jahr wird, in dem&nbsp;diese armen Gesch&ouml;pfe&nbsp;erfahren, was es wirklich hei&szlig;t ein besinnliches Fest zu verbringen.&nbsp;Deswegen habe ich im&nbsp;Folgenden drei&nbsp;Tipps und Tricks zusammengesucht, die es f&uuml;r absolut jeden m&ouml;glich machen, w&auml;hrend der Vorweihnachtszeit&nbsp;nicht nur Nerven und Stress, sondern gleichzeitig auch bares Geld&nbsp;zu sparen.</p>\r\n','2014-01-28 20:53:13','2014-01-28 20:53:13'),(201,6,'Vorzeitiges Planen und Ideen sammeln','<p>F&uuml;r viele mag das &uuml;bertrieben klingen, aber man&nbsp;kann nie fr&uuml;h genug beginnen Ideen&nbsp;f&uuml;r Geschenke zu sammeln, denn:<em>&nbsp;</em>Vor Weihnachten ist nach Weihnachten!&nbsp;F&uuml;r die ganz Organisierten unter uns mag es sich&nbsp;sogar empfehlen eine Liste anzulegen, wo Geistesblize und verborgene Anspielungen von den Liebsten sofort f&uuml;r die Ewigkeit festgehalten werden k&ouml;nnen. Beziehungsweise&nbsp;wenn schon nicht f&uuml;r die Ewigkeit, dann wenigstens bis zum n&auml;chsten Weihnachtsfest, wo sich die &uuml;ber das&nbsp;Jahr&nbsp;hinweg gesammelten Ideen dann mit Sicherheit mehr als n&uuml;tzlich erweisen werden. So vermeidest du nicht nur einen beschwingtes, vorweihnachtliches Kopfzerbrechen, sondern kannst auch &uuml;ber das Jahr hinweg durch passenden Schn&auml;ppchen und Angeboten eine Menge Geld sparen. So schl&auml;gst du am Ende zwei Fliegen mit einer Klappe! Und hast du erst mal einen ungef&auml;hren&nbsp;Anhaltpunkt, musst du noch nicht&nbsp;mal mehr sonderlich kreativ sein - denn das &uuml;bernimmt <em>Goolge&nbsp;</em>gerne f&uuml;r dich! Nicht nur, dass du so heutzutage fast alles ganz bequem von daheim aus bestellen kannst, sondern beim St&ouml;bern im Internet wirst du des Weiteren &uuml;ber viele verwandte Themen und &auml;hnliche&nbsp;Produkte stolpern, von denen du zuvor noch nicht einmal wusstest, dass es sie gibt!</p>\r\n','2014-01-28 20:53:13','2014-01-28 20:53:13'),(202,6,'Geschenke von Herzen anstatt aus dem Geldbeutel','<p><span style=\"font-size: 14px;\">Was aber, wenn d</span><span style=\"font-size: 14px;\">en bescheidenen</span><span style=\"font-size: 14px;\">&nbsp;Freunden und Familienmitgliedern einfach kein Wunsch von den Lippen abzulesen ist? Dann ist erst recht der Einfallsreichtum des Schenkers gefragt! Und damit meine ich nicht einen einfallsreichen Griff in den Geldbeutel!</span><span style=\"font-size: 14px;\">&nbsp;</span><em style=\"font-size: 14px;\">Ein Geschenk ist immer nur so viel Wert wie die Liebe, mit der es ausgesucht worden ist.&nbsp;</em><span style=\"font-size: 14px;\">So neunmalklug dieses Sprichwort auch klingen mag, manch einer&nbsp;sollten es sich wirklich zu Herzen nehmen. Denn gerade dann, wenn keine speziellen W&uuml;nsche vorliegen, kann man doch viel mehr beim Beschenkten</span><span style=\"font-size: 14px;\">&nbsp;p</span><span style=\"font-size: 14px;\">unkten, wenn man zeigt, dass man sich beim Aussuchen des Geschenkes Gedanken</span><span style=\"font-size: 14px;\">&nbsp;gemacht hat - etwa wenn das Geschenk mit einer kleinen Anekdote verbunden ist oder an ein gemeinsames Erlebnis erinnert. Deswegen sind genau diese Geschenke</span><span style=\"font-size: 14px;\">&nbsp;oftmals f&uuml;r wenig Geld zu haben und gleichzeitig jedoch</span><span style=\"font-size: 14px;\">&nbsp;unbezahlbar. Wer hier total ideenlos ist, kann ja einfach mal mit Fotos anfangen und dann Websites wie <em><a href=\"http://www.pixum.at\">Pixum</a></em>&nbsp;die eigentliche Arbeit &uuml;berlassen, wo die Fotos und pers&ouml;nlichen Texte dann zu kompletten Fotob&uuml;chern und Gru&szlig;karten verarbeitet werden. Besonders vor Weihnachten finden sich hier auch tolle Sparangebote and Aktionen!</span></p>\r\n','2014-01-28 20:53:13','2014-01-28 20:53:13'),(203,6,'PersÃ¶nliches und Handgemachtes','<p>Warum haben sich unsere Eltern eigentlich fr&uuml;her immer so sehr &uuml;ber unsere selbst gebastelten Geschenke gefreut? Weil sie von hohem praktischen Nutzen waren? ... hmm, wohl eher nein ...&nbsp;weil sie eine Augenweide f&uuml;r jeden Betrachter darstellten? Herr Gott im Himmel, DEFINITIV NICHT! ...&nbsp;die haben nur so getan als w&uuml;rden sie sich freuen?! Oh ja, das mag dem letzten Misstrauischem als einzig&nbsp;logische Erkl&auml;rung &uuml;brig bleiben. Doch das ist nicht der Fall: Jeder schief ausgeschnittene Weihnachtsstern, jedes unleserliche Gedicht und jedes &uuml;ber den Rand gekrakelte Bild wird zur wahren Freude eines jeden Elternteils, weil es von Herzen kommt! Deswegen mein Tipp: Auch wenn das k&uuml;nstlerische Talent eines manchen sich auch heute noch auf dem Niveau eines Vorschulkindes zu befinden scheint, lasst es euch nicht nehmen wenigstens einmal im Jahr zu Kleber, Schere und Papier zu greifen. Unz&auml;hlige tolle Bastelanleitungen finden sich im allseits bekannten World Wide Web.&nbsp;Und wer wirklich zwei linke H&auml;nde hat - Backen konnte mit dem richtigen Rezept noch jeder! Deswegen gibt es hier keine faulen Ausreden!&nbsp;Selbst gemachte Geschenke sind fast immer beliebt und m&uuml;ssen deswegen nur mit etwas Kreativit&auml;t und warmen Gedanken an den Empf&auml;ngern versehen werden. Und dass Selberbasteln der absolut billigstes Spartipp von allen ist, braucht wohl nicht erst extra erw&auml;hnt zu werden!</p>\r\n\r\n<p style=\"line-height:12.75pt\"><font face=\"Arial, sans-serif\">Am Ende kann gesagt werden, wenn du es schaffst, auch nur einen dieser drei Tipps in die Tat umzusetzen, dann ist dein Weihnachtsabend schon so gut wie gerettet. Jetzt kannst du nur noch hoffen und zum Christkind beten, dass deine Freunde auch einen dieser schlauen Saving-Guides zum Thema Weihnachtsgeschenke zu Rate gezogen haben. Denn dann hast du nichts mehr zu bef&uuml;rchten, und ich w&uuml;nsche dir in diesem Sinne:<strong> Frohe Weihnachten und ein besinnliches Fest!</strong></font></p>\r\n','2014-01-28 20:53:13','2014-01-28 20:53:13'),(204,5,'Gefahren im Internet','<p>Mittlerweile ist das Internet f&uuml;r uns nicht mehr wegzudenken. Wir shoppen, halten Kontakt zu Freunden, Familie und Bekannten, informieren uns zu allen m&ouml;glichen Themen und verbringen somit sehr viel Zeit im World Wide Web. Wir sind mittlerweile so routiniert, dass wir gar nicht mehr &uuml;ber die Gefahren nachdenken, die im Web lauern. Wir haben f&uuml;r euch ein paar Sachen zusammengestellt, bei denen man aufpassen sollte.</p>\r\n','2014-01-28 20:53:56','2014-01-28 20:53:56'),(205,5,'Gefahr â€œE-Commerceâ€','<p>Dieser Absatz widmet sich deinen Online-Eink&auml;ufen, die sich vermutlich auch bei dir in den letzten Monaten h&auml;ufen. Was kaufst du heutzutage im Netz? Kleidung bei Zalando? Schmuck bei Otto? Auch kostspieligere Elektro-Ger&auml;te auf Amazon und gar Reisen &uuml;ber Expedia? Da bist du auch nicht der Einzige: Laut dem Bundesverband Informationswirtschaft, Telekommunikation und neue Medien e.V. haben &uuml;ber 14 Millionen Deutsche Reisen &uuml;ber das Internet gebucht und 5 Millionen buchen ihre Reise ausschlie&szlig;lich online (Stand 2012).</p>\r\n\r\n<p>Die Auswahl ist gro&szlig; und man kann fast alles im Netz kaufen. Du musst jedoch darauf achten, was f&uuml;r eine Art Shop es ist. Wenn es f&uuml;r dich auf den ersten Blick schon suspekt ausschaut und du dem ganzen nicht traust, lasse es lieber bleiben. Die sogenannten Fake-Shops sind ziemlich gut versteckt. Diese kopieren nicht nur das Aussehen von bekannten Webseiten, sondern auch deren AGBs und sehen so f&uuml;r einen allt&auml;glich Shopper vertrauensw&uuml;rdig aus. Wie man dagegen vorgehen kann? Informiere dich, denn neben der F&auml;higkeit zu shoppen, bietet das Internet auch eine riesige Informationsplattform, bei der man sich austauschen kann. Setze auf die Erfahrung der anderen Shopper. Auch musst du auf Bezahlarten achten. Grunds&auml;tzlich ist der Rechnungskauf am sichersten. Gib deine Kontodaten nur dann an, wenn du dir auch sicher mit dem Shop bist! Vergleichen lohnt sich! Ist das der einzige Shop, der das ausgew&auml;hlte Produkt zu einem sehr niedrigen Preis anbietet, ist die Situation schon fragw&uuml;rdig. Hierzu k&ouml;nntest du auch die <a href=\"http://verbraucherrecht.at/cms/index.php\">Verbraucherzentrale </a>kontaktieren, diese k&ouml;nnen dann nicht nur dir, sondern auch anderen Shoppern in gleicher Situation helfen.</p>\r\n','2014-01-28 20:53:56','2014-01-28 20:53:56'),(206,5,'Gefahr â€œViren und Trojanerâ€','<p><span style=\"font-size: 14px;\">Jeder hat es mal erlebt. Der Computer hat sich einen Virus eingefangen. Doch wo kommt er her und wie kann man ihn vermeiden? In diesem Fall helfen in erster Linie Anti-Virus-Programme wie Kaspersky. Damit sollte es nicht dazu kommen, dass sich ein Virus oder ein Trojaner in deinem PC einnistet. Doch auch kannst du vorsorgen, indem du nie Anh&auml;nge von E-Mails &ouml;ffnest, die nicht gepr&uuml;ft wurden oder von denen dir der Absender nicht bekannt ist. Du solltest nie Links verfolgen, bei denen du dir nicht sicher bist, wohin diese f&uuml;hren. Dies gilt auch f&uuml;r soziale Netzwerke: Vorsicht mit Klicks!</span></p>\r\n','2014-01-28 20:53:56','2014-01-28 20:53:56'),(207,5,'Gefahr â€œAbo-Fallenâ€','<p>Mit dem Internet ist es auch eindeutig leichter geworden, uns in eine Abo-Falle zu locken. Wo man fr&uuml;her eine Unterschrift oder zumindest eine m&uuml;ndliche Zusage ben&ouml;tigte, reicht heute ein einfacher Klick. Lies dir genau durch, f&uuml;r was du deine Zustimmung gibst. Beliebt f&uuml;r Abo-Fallen sind Witze-Seiten oder Gratis-SMS Seiten. Meist ist auf der Webseite sogar das Kleingedruckte zu finden, das ist jedoch so gut versteckt, dass man dieses gern &uuml;berliest. Solltest du dich da jedoch trotzdem vertan haben, so kannst du dein neues Abo widerrufen. Bezahl&nbsp;auf keinen Fall Rechnungen, denn oft ist das Geld dann weg. Kontaktiere hier die <a href=\"http://verbraucherrecht.at/cms/index.php\">Verbraucherzentrale</a>, denn diese kennt sich mit Abo-Fallen aus und kann dir genauestens sagen, wie du vorzugehen hast.</p>\r\n\r\n<p>Abschlie&szlig;end kann man sagen: Augen auf beim Surfen! Informiere dich, wenn dir etwas suspekt ist, klicke nie auf Seiten, die dir unbekannt sind, und gib deine Kontodaten nie an unbekannte Shops weiter. Schlie&szlig;lich soll das Surfen doch Spa&szlig; machen.</p>\r\n','2014-01-28 20:53:56','2014-01-28 20:53:56'),(214,7,'Go local or go home','<p>Auch wenn man es auf den ersten Blick gar nicht so wahrnimmt, aber tun was die &ldquo;Locals&rdquo; tun, kann einem selber im Urlaub fast in jeder Lebenslage einiges an Geld sparen. Man nehme zum Beispiel das von Touristen &uuml;berrannte Restaurant am Bahnhof, oder aber das kleine, versteckte Bistro im hippen Anwohnerviertel &nbsp;&ndash; wo wird man wohl die faireren Preise bekommen? Und nicht nur das, oftmals ist auch einfach die Qualit&auml;t 100x besser.</p>\r\n\r\n<p>Hier findest du deswegen 5 Tipps und Tricks wie du es schaffst, zu tun was die Locals tun, und dabei nicht nur Geld sparst, sondern auch einzigartige Erfahrungen sammelst.&nbsp;</p>\r\n','2014-02-11 22:01:54','2014-02-11 22:01:54'),(215,7,'1. Nimm dir die Zeit und suche aktiv','<p>Zeit ist oftmals unser wertvollstes Gut im Urlaub. Trotzdem sollte man nicht darauf warten, zuf&auml;llig &uuml;ber die besten Spots fernab vom Touristengetummel zu stolpern, denn so einfach ist das nicht. &ldquo;Going local&rdquo; hat nichts damit zu tun die beliebtesten Touristenpunkte auf einer To-Do Liste abzuhaken - erst einmal muss Zeit aufgewandt werden die &ldquo;geheimen&rdquo; und &ldquo;versteckten&rdquo; nicht-touristischen Orte zu finden; und dann muss man spontan genug sein, um sie in vollen Z&uuml;gen zu genie&szlig;en. Man wei&szlig; n&auml;mlich vorher nie so genau, was man zu erwarten hat.</p>\r\n','2014-02-11 22:01:54','2014-02-11 22:01:54'),(216,7,'2. Weg mit dem ReisefÃ¼hrer','<p>Wenn du zu Hause in deiner Heimatstadt bist, wie oft benutzt du einen Reisef&uuml;hrer? Vielleicht h&ouml;chstens, wenn du Freunde zu besuch hast und ihnen die Sehensw&uuml;rdigkeiten zeigen willst. Deswegen musst du, wenn du wirklich das richtige Leben an deinem Urlaubsort sehen willst,zum Beispiel die regionale Zeitung und Magazine lesen. Suche darin vor allem nach interessanten Events. Ich selbst habe auf meinen Reisen des &Ouml;fteren viele kleine, unbekannte Veranstaltungen besucht und bin wegen der pers&ouml;nlichen Atmosph&auml;re umso &ouml;fter mit interessanten und weltoffenen Menschen ins Gespr&auml;ch gekommen.</p>\r\n\r\n<p>Hier noch ein ganz spezieller Tipp: Google doch mal f&uuml;r deinen Urlaubsort Organisation wie <a href=\"http://www.berlin-greeter.org/\">Berlin Greeter</a>. Hier kannst du Kontakt mit Locals aufnehmen, die gerne neue Leute kennenlernen und f&uuml;r diese mit Freude den Reisef&uuml;hrer ihn ihrer Heimatstadt spielen. Das ganze ist nat&uuml;rlich auch v&ouml;llig kostenos. &nbsp;</p>\r\n','2014-02-11 22:01:54','2014-02-11 22:01:54'),(217,7,'3. Kaufe auf MÃ¤kten und in â€œTante Emma LÃ¤denâ€ ein','<p>Dies macht besonders Sinn, wenn du ein Apartment mit eigener K&uuml;chenzeile hast oder in einem Hostel wohnst, wo du die M&ouml;glichkeit hast, dir dein Essen selbst zuzubereiten; denn das ist auch was Locals tun, sie gehen nicht immer aus zum Essen. W&auml;hrend meinen Reisen musste ich immer wieder feststellen, wie viel man &uuml;ber eine Kultur und ihre Leute lernen kann, wenn man sich einfach nur in einem Supermarkt, oder noch besser Wochenmarkt, aufh&auml;lt (nat&uuml;rlich die nicht-touristischen). Hier ist, wo sich das wirkliche Leben abspielt. Und ganz nebenbei sind einheimische Produkte meistens auch noch viel billiger als die &uuml;blichen Touristenfallen.</p>\r\n','2014-02-11 22:01:54','2014-02-11 22:01:54'),(218,7,'4. Lerne die einheimische Sprache','<p>Ich pers&ouml;nlich finde, man sollte alles wenigstens einmal probiert haben &ndash; keine faulen Ausreden! Im Urlaub immer nur Pizza, Spaghetti und Burger zu essen, ist einer der offensichtlichsten Wege, um zu sagen: &ldquo;Ich wei&szlig; mit eurer Kultur nichts anzufangen&rdquo;.&nbsp; Denn der Weg eine fremde Kultur zu verstehen (und ein Local zu werden), ist sicherlich auch durch die einheimische K&uuml;che. Vertrau mir, du wirst &uuml;berrascht sein, was so alles essbar (und lecker! ) ist.</p>\r\n','2014-02-11 22:01:54','2014-02-11 22:01:54'),(219,7,'5. Besorge dir eine SIM-Card fÃ¼r dein Telefon','<p>Dies macht schon in den meisten F&auml;llen Sinn, auch wenn du nur ein oder zwei Wochen an einem Urlaubsort bist. Viele Telefonanbieter haben ihr Angebot extra darauf ausgelegt, es f&uuml;r jemanden, der nur vor&uuml;bergehend eine Telefonkarte nutzen will, erschwinglich zu machen. Deswegen sind zum Beispiel Datenpakete f&uuml;r dein Smartphone mit der lokalen SIM-Card total einfach und sehr billig zu kaufen. F&uuml;r ein paar Euro hast du dann also immer und &uuml;berall Zugang zum Internet - wie ein echter Local &ndash; und kannst dich deswegen viel einfacher zurechtfinden und nach Schn&auml;ppchen jagen.&nbsp;&nbsp;</p>\r\n','2014-02-11 22:01:54','2014-02-11 22:01:54');
