INSERT INTO `articlecategory` VALUES (1,'Rabatt auf Reisen','rabatt-auf-reisen','Spartipps | Rabatt auf Reisen - Flipit.com','Wie spart man eigentlich auf Reisen? Auf Flipit zeigen wir dir alle MÃ¶glichkeiten, wie du Rabatte im Urlaub abstauben kannst.','Alles rund um den Urlaub, das gibt es in dieser Kategorie. Von der Auswahl des Reiseziels über die Vorbereitungen bis hin zum Urlaubstag. Wir zeigen dir die neusten Trends, die aktuellsten Angebote und die besten Möglichkeiten bei deiner nächsten Reise ein paar Euro zu sparen.',NULL,52,0,'2013-09-13 20:28:57','2013-09-13 20:28:57'),(2,'Tipps fÃ¼r AusflÃ¼ge','ausflug','Tipps fÃ¼r AusflÃ¼ge - Flipit.com','Tipps fÃ¼r AusflÃ¼ge gibt es bei Flipit. Wir haben eine Reihe an VorschlÃ¤gen, wie du bei deinem nÃ¤chsten Ausflug Geld sparen kannst.','Wie spart man eigentlich bei einem Ausflug? Es gibt einige Optionen, wie man das tun kann. Wir haben uns auf die Suche begeben und einige Tipps zusammengestellt, wie man zum Beispiel im Freizeitpark Geld sparen kann. ',NULL,102,0,'2013-09-20 17:57:37','2013-09-20 17:57:37'),(3,'Online sparen','online-sparen','Online sparen - Flipit.com','Online sparen, das will jeder. Welche MÃ¶glichkeiten es gibt und wie du noch ein paar mehr Euro zahlst, das haben wir fÃ¼r dich zusammengestellt.','Mittlerweile kann man so gut wie alles online erledigen. Anstatt Papiergutscheine auszuschneiden, können online Gutscheine eingelöst werden. Das ist aber noch längst nicht alles. Es gibt einige Möglichkeiten wie man im Internet Geld sparen kann. Eins der Themen sind Vergleichsportale, wie sie funktionieren und wie man sie am effektivsten nutzt.',NULL,111,0,'2013-09-24 15:14:38','2013-09-24 15:14:38'),(4,'Fixkosten reduzieren','fixkosten','Fixkosten reduzieren - Flipit.com','Fixkosten reduzieren kann so einfach sein. Wie das geht? Wir zeigen es dir! AusfÃ¼hrlich und zu verschiedenen Situationen.','Muss der Wasserverbrauch wirklich so hoch sein? Wie wird die Rechnung am Ende des Monats geringer? Dies und mehr zeigen wir dir in unseren Spartipps zum Thema \'Fixkosten reduzieren\'. Dort erklären wir dir ausführlich, wie du hier und da einige Euro sparen kannst.',NULL,113,0,'2013-09-24 17:49:13','2013-09-24 17:49:13'),(5,'Gefahren im Internet','gefahren-internet','Gefahren im Internet - Flipit.com','Gefahren im Internet, und wie du sie erkennst - wir haben uns auf die Suche begeben, um dich vor allen MÃ¶glichkeiten zu warnen.','Im Internet ist nicht alles immer nur schön. Auf der Schattenseite sind Betrüger, die anderen Leuten das Geld aus der Tasche ziehen wollen. Welche fiesen Tricks sie anwenden, und wie du dich davor schützen kannst, haben wir für dich zusammengestellt.',NULL,115,0,'2013-09-24 19:07:39','2013-09-24 19:07:39');
