INSERT INTO `category` VALUES (23,'Software','categorieen/software','','','',1,1962,1,'2013-01-22 20:12:59','2013-01-22 20:12:59'),(24,'Baby & Kinderen','baby-kinderen','Vind hier de grootste korting op Baby- en Kinderspullen - Flipit.com','Omdat je als jonge moeder vaak al veel aan je hoofd hebt, vind je hier bij Flipit.com een overzicht van alle kortingen op baby- en kinderspullen.','Ben je in verwachting of heb je net een kindje? Of ben je op zoek naar het allerleukste babycadeau? Hier vind je een overzicht van aanbiedingen en hoge kortingen van diverse webshops. Met kortingscodes kun je vaak heel wat besparen op kinderspullen, zodat je nooit de volle pot moet betalen.',1,13,1,'2013-04-23 17:29:00','2013-05-01 19:55:23'),(25,'Bloemen & Geschenken','bloemen-geschenken','Bloemen en geschenken kortingscodes - Flipit.com','Bij elke gelegenheid past wel een mooie bos bloemen. Betaal nooit teveel: gebruik een kortingscode van Flipit.com.','Zoek je een boeket voor Moederdag, of wil je je geliefde verrassen met een bos rode rozen? Met het juiste boeket kun je een krachtige boodschap overbrengen. Hier vind je het kortingscode overzicht van alle bloemisten, zodat je nooit te veel hoeft te betalen wanneer je online bloemen koopt.',1,14,1,'2013-04-23 17:30:16','2013-05-01 19:37:16'),(26,'Boeken, Films & Muziek','boeken-films-muziek','Boeken, films en muziek kortingscodes - Flipit.com','Op zoek naar een leuk cadeau, zoals een boek, dvd of cd? Op Flipit.com vindt je altijd korting of een leuke aanbieding voor deze artikelen.','Een boek, dvd of cd valt bijna altijd in de smaak. Voor iedereen is er wel een goed boek of mooie muziek te vinden! En het hoeft je niet eens veel te kosten, met de juiste kortingen kun je vele euro\'s besparen. In dit kortingsoverzicht vind je de beste aanbiedingen en kortingen van diverse webshops.',1,15,1,'2013-04-23 17:31:15','2013-05-01 19:37:43'),(27,'Computer & Software','computer-software','Computer & Software kortingscodes | Flipit.com','Bekijk hier alle kortingen op laptops, desktops, games en andere software. Compleet overzicht van online korting op Computer & Software van Flipit.com','Vind hier de beste laptop-aanbiedingen, desktop-vouchercodes en software-promoties van het web. Met deze kortingscodes betaal je altijd de laagste prijs voor elektronica. In het overzicht vind je alle geactualiseerde kortingscodes zodat je direct van de beste deals kunt profiteren.',1,16,1,'2013-04-23 17:31:51','2013-05-01 19:41:17'),(28,'Dagje weg','dagje-weg','Dagje uit- Flipit.com','Gezellig met de kinderen naar het pretpark? Op Flipit.com vind je de beste aanbiedingen en kortingen om te besparen op je dagje weg!','Gezellig genieten van je vrije dag met de kinderen of met je vrienden naar een pretpark? Flipit.com helpt je besparen op deze vaak dure uitstapjes naar bijvoorbeeld de dierentuin of een attractiepark. Bekijk hier alle aanbiedingen en kortingen voor het leukste dagje weg. Zo wordt je uitstapje nóg leuker!',1,17,1,'2013-04-23 17:32:30','2013-05-01 19:34:37'),(29,'Dieren & Benodigdheden','dieren-benodigdheden','Dierenbenodigdheden kortingscodes - Flipit.com','Bespaar op dierenproducten zoals dierenvoeding of dierenmanden. Hier vind je kortingscodes om te besparen op alle artikelen voor je huisdier!','Een huisdier is niet goedkoop. Je bent vaak veel geld kwijt aan voeding, verzorging en speelgoed. Omdat ze niet de dupe mogen worden van deze hoge kosten, vind je hieronder een compleet overzicht van online dierenwinkels met bijbehorende aanbiedingen en kortingscodes. Zo kun je onbezorgd genieten van je huisdier!',1,18,1,'2013-04-23 17:33:17','2013-05-01 19:39:40'),(30,'Elektronica & Huishoudelijk','elektronica-huishoudelijk','Electronica & Huishoudelijke Apparatuur korting- Flipit.com','Koop huishoudelijke apparaten en elektronica voordeliger met een van de kortingscodes van Flipit.com.','Huishoudelijke apparaten shoppen is misschien niet het leukste wat er is. Je moet vaak een evenwichtige keuze maken uit dure artikelen die lange tijd moeten meegaan. Met dit overzicht helpen we je al een handje op weg: hier staan alle beschikbare kortingscodes voor diverse elektrozaken.',1,19,1,'2013-04-23 17:33:44','2013-05-01 19:40:59'),(31,'Eten & Drinken','eten-drinken','Eten & Drinken kortingscodes - Flipit.com','Op de hoogte blijven van alle leuke eten en drinken-aanbiedingen in jouw buurt? Hier vind je een compleet overzicht, van McDonalds tot dure restaurants!','Tegenwoordig hoeft een romantisch diner niet per se meer duur te zijn. Met onze kortingen kun je lekker uit eten gaan zonder dat je je zorgen hoeft te maken over de rekening. Geniet nog meer van je avondje uit eten door dit kortingsoverzicht in de gaten te houden.',1,20,1,'2013-04-23 17:35:06','2013-05-01 19:43:01'),(32,'Fotografie & Printen','fotografie-printen','Fotografie & Printen kortingscodes - Flipit.com','Laat je mooiste momenten afdrukken op textiel of canvas, of maak er een unieke kalender mee! Hier vind je een overzicht van alle kortingscodes voor het afdrukken van foto\'s.','Tegenwoordig kun je allerlei dingen doen met je foto\'s. In plaats van ze op de computer te laten staan, kan je ze digitaal opsturen en op canvas, acryl of katoen printen. Of je laat er een unieke kalender van maken die je cadeau kan doen! De beste aanbiedingen en kortingscodes hiervoor vind je op Flipit.com.',1,21,1,'2013-04-23 17:35:29','2013-05-01 19:44:39'),(33,'Gezondheid & Verzorging','gezondheid-verzorging','Gezondheid & Verzorging kortingscodes - Flipit.com','Online parfum, gezichtscrÃ¨me of bodylotion bestellen? De hoogste kortingen vind je hier op Flipit.com!','Op zoek naar een heerlijk parfum of een goede shampoo? In dit overzicht vind je aanbiedingen en hoge kortingen op  wellness en gezondheidsproducten. Koop cosmetica, scheerproducten en bodylotions met korting via Flipit.com.',1,22,1,'2013-04-23 17:35:56','2013-05-01 19:45:44'),(34,'Huis & Tuin','huis-tuin','Huis & Tuin kortingscodes - Flipit.com','Korting op je tuinstoelen? Besparen op muurverf? Hier vind je alle kortingscodes voor Huis & Tuin.','Met de kortingscodes van Flipit.com bespaar je op een nieuwe set tuinstoelen, zacht dekbed of mooie gordijnen. Bestel je complete interieur met korting via de kortingscodes van Flipit.com. Hieronder een overzicht van alle beschikbare aanbiedingen en kortingen voor alle artikelen van Huis & Tuin.',1,23,1,'2013-04-23 17:36:18','2013-05-01 19:46:37'),(35,'Kansspelen & Loterij','kansspelen-loterij','Kansspelen en Loterij - Flipit.com','Wil je kans maken op een groot geldbedrag met de loterij? Hier vind je een compleet overzicht van alle kortingscodes voor online kansspelen.','Zin om een gokje te wagen? Heb je het gevoel dat het geluk aan jouw kant staat en wil je een lot kopen voor de loterij? Op internet kun je snel en gemakkelijk meedoen aan diverse kansspelletjes en loterijen. Speel met korting mee door een van de kortingscodes van Flipit.com te gebruiken. Je vindt ze allemaal hieronder!',1,24,1,'2013-04-23 17:36:43','2013-05-01 19:47:23'),(36,'Mode & Accessoires','mode','Mode & Accessoires - Flipit.com','Vind alle beschikbare kortingscodes voor H&M, ASOS en Zalando in dit overzicht van Flipit.com.','Op zoek naar een kortingscode voor je favoriete webshop? Vind hier alle kortingscodes en aanbiedingen op het gebied van Mode & Accessoires. Bespaar op die hippe schoenen of een nieuwe tas door gebruik te maken van deze aanbiedingen.',1,25,1,'2013-04-23 17:37:16','2013-05-01 19:48:21'),(37,'Opleiding & Hobby','opleiding-hobby','Opleiding & Hobby kortingscodes - Flipit.com','Online een opleiding of een cursus volgen? Met Flipit.com profiteer je van korting op je aanmelding en inschrijfkosten.','Na je werk een cursus of opleiding volgen? Of gewoon omdat je graag op je eigen tempo thuis studeert? Bij Flipit.com verzamelen we de beste aanbiedingen om te besparen op alle online, thuis- en/of individuele opleidingen en cursussen!',1,26,1,'2013-04-23 17:37:36','2013-05-01 19:49:04'),(38,'Schoenen','schoenen','Schoenen kortingscodes - Flipit.com','Shopverslaafd en op zoek naar nieuwe schoenen? Dan ben je hier aan het juiste adres. Vind de hoogste kortingen voor jouw favoriete webshop bij Flipit.com','Of je nu op zoek bent naar nieuwe pumps of warme winterlaarzen, bij Flipit.com vind je een divers aanbod van online schoenenwinkels met alle beschikbare aanbeidingen en kortingscodes. Bespaar en loop net even wat comfortabeler in je nieuwe schoenen!',1,27,1,'2013-04-23 17:37:56','2013-05-01 19:50:17'),(39,'Sport & Outdoor','sport-outdoor','Sport & Outdoor - Flipit.com','Op zoek naar joggingschoenen, een winddichte jas of een trainingsbroek? Bekijk in dit Flipit.com overzicht alle aanbiedingen en kortingscodes voor Outdoor & Sport.','Op zoek naar een outdoor uitrusting voor voetbal, joggen of andere sporten? Hier vind je allerlei shops die deze artikelen aanbieden. Shop je sport- en outdoorkleding lekker makkelijk via het internet, en profiteer van de laagste prijzen met de kortingscodes van Flipit.com.',1,28,1,'2013-04-23 17:38:19','2013-05-01 19:52:02'),(40,'Vakantie & Reizen','reizen-vakantie','Vakantie en Reizen kortingscodes - Flipit.com','Alles voor de goedkoopste vakantie of reis vind je hier bij Flipit.com, met constant geactualiseerde kortingscodes en de beste aanbiedingen van het web!','Op zoek naar een voordelig vliegticket of gewoon een auto huren met korting? In dit overzicht vind je alle kortingen die je zoekt. Van een goedkope hotelovernachting tot een zonnige last-minute. Check dit overzicht voor alle beschikbare kortingen en aanbiedingen op het gebied van vakantie en vervoer.',1,29,1,'2013-04-23 17:38:39','2013-05-01 19:52:43'),(41,'Verzekeringen & Financieel','verzekeringen-financieel','Verzekeringen en FinanciÃ«n - Flipit.com','Besparen op je verzekering? Bekijk in dit kortingsoverzicht van Flipit.com hoe dat kan.','Er valt een hoop te besparen op hypotheken, energierekeningen en verzekeringen. In dit kortingsoverzicht vind je alle aanbiedingen en kortingen