INSERT INTO `footer` VALUES (2,'<p style=\"margin: -10px 0px 10px;\">Alle &quot;exklusiv&quot; markierten Gutscheine d&uuml;rfen nicht ohne die schriftliche Zustimmung von Flipit.com ver&ouml;ffentlicht werden. Alle Angebote sind von unserer Redation sorf&auml;ltig ausgesucht und sind g&uuml;ltig vom Zeitpunkt der Ver&ouml;ffentlichung.&nbsp;Mehr dazu im <a href=\"/at/info/disclaimer\" rel=\"nofollow\" style=\"color: rgb(0, 136, 204);\" target=\"_blank\">Disclaimer</a>&nbsp;und <a href=\"http://www.flipit.com/at/info/impressum\" style=\"color: rgb(0, 136, 204);\" target=\"_blank\">Impressum</a></p>\r\n','<ul>\r\n	<li class=\"k-codes\">\r\n	<h3>Gutscheincodes?</h3>\r\n\r\n	<ul>\r\n		<li><a href=\"http://www.flipit.com/at/info/gutscheincodes\" rel=\"nofollow\">Wie benutzt man die Codes?</a></li>\r\n		<li><a href=\"http://www.flipit.com/at/beliebt\">Beliebte Gutscheincodes</a></li>\r\n		<li><a href=\"http://www.flipit.com/at/alle-shops\">Alle Shops auf Flipit.com</a></li>\r\n		<li><a href=\"http://www.flipit.com/at/kategorie\">Kategorien auf Flipit.com</a></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n','<ul>\r\n	<li class=\"help\">\r\n	<h3>Ich brauche Hilfe</h3>\r\n\r\n	<ul>\r\n		<li><a href=\"http://www.flipit.com/at/info/uber-uns\" rel=\"nofollow\">Wie funktioniert Flipit.com?</a></li>\r\n		<li><a href=\"http://www.flipit.com/at/vorteil\" rel=\"nofollow\">&Uuml;ber die Saving Guides</a></li>\r\n		<li><a href=\"http://www.flipit.com/at/info/haufige-fragen\" rel=\"nofollow\">H&auml;ufige Fragen (FAQ)</a></li>\r\n		<li><a href=\"http://www.flipit.com/at/info/werben\" rel=\"nofollow\">Werben auf Flipit.com</a></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n','<ul>\r\n	<li class=\"over-ons\">\r\n	<h3>Das sind wir</h3>\r\n\r\n	<ul>\r\n		<li><a href=\"http://www.flipit.com/at/redaktion\" rel=\"nofollow\">Redaktion</a></li>\r\n		<li><a href=\"http://www.flipit.com/at/info/kontakt\" rel=\"nofollow\">Kontakt</a></li>\r\n		<li><a href=\"http://www.flipit.com/at/info/privacy-cookies\" rel=\"nofollow\">Datenschutz</a></li>\r\n		<li><a href=\"http://www.flipit.com/at/info/presse\" rel=\"nofollow\">Presse</a></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n','<div class=\"kcode-news-hdr\">Flipit.com Newsletter</div>\r\n\r\n<p>Empfange die besten Angebote und<br />\r\nexklusiven Rabatte per E-Mail</p>\r\n\r\n<div class=\"kcode-news-img\"><img alt=\"\" src=\"/public/images/front_end/msg-icon.png\" /></div>\r\n\r\n<div class=\"register-outer\" lpcachedvistime=\"1378975172\" lpcachedvisval=\"1\">\r\n<form action=\"\" id=\"hnewsletter\" lpcachedvistime=\"1378975172\" lpcachedvisval=\"1\" lpsubdone=\"1\" method=\"post\" name=\"hnewsletter\"><input id=\"homeemail\" lpcachedvistime=\"1378975172\" lpcachedvisval=\"1\" name=\"homeemail\" onblur=\"if(this.value==\'\') this.value=this.defaultValue;\" onfocus=\"if(this.value==this.defaultValue) this.value=\'\';\" type=\"text\" value=\"Deine E-Mail Adresse\" />\r\n<div class=\"reg-btn\" id=\"newsletter-btn\" style=\"cursor: pointer;\"><a href=\"javascript:;\">Anmelden</a></div>\r\n</form>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n','<p style=\"margin: -5px auto 20px;\"><img src=\"http://www.flipit.com/public/at/images/upload/media/osterreich.png\" style=\"margin: 0px auto;\" /> <a href=\"http://www.flipit.com/at\" style=\"color: rgb(0, 136, 204);\">Flipit &Ouml;sterreich</a> | <a href=\"http://www.facebook.com/flipitcom\" style=\"color: rgb(0, 136, 204);\" target=\"_blank\"> Folg uns auf Facebook und lern mehr &uuml;ber unser Flipit.com Abenteuer</a> | <a href=\"http://www.flipit.com\" style=\"color: rgb(0, 136, 204);\" target=\"_blank\">Flipit.com International</a></p>\r\n\r\n<p><img alt=\"Flipit.com Logo\" src=\"http://www.flipit.com/public/at/images/upload/media/thumb_L/flipit-footer.png\" style=\"margin: 0px auto;\" /></p>\r\n',0,'2012-10-15 17:22:53','2013-10-08 17:43:49');
