INSERT INTO `shop_howto_chapter` VALUES (151,101,'1. Produkt auswÃ¤hlen','<p>Nachdem du einen passenden Artikel gefunden hast, f&uuml;ge diesen deinem Warenkorb hinzu, indem du auf das gr&uuml;ne &quot;In den Warenkorb&quot;-Feld klickst.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/1%20gross(1).png\" style=\"width: 745px; height: 318px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-23 19:52:59','2014-01-23 19:52:59'),(152,101,'2. Gutscheincode kopieren und einfÃ¼gen','<p>Nachdem du deinen Artikel dem Warenkorb hinzugef&uuml;gt hast, wirst du automatisch zu deinem Warenkorb weitergeleitet. Hier wird dir nochmals eine &Uuml;bersicht deiner Produkte angezeigt. Weiter unten auf derselben Seite findest du dann auch schon das entsprechende Feld f&uuml;r deinen Vorteilscode. Wenn du jetzt von Flipit deinen Gutscheincode kopierst,&nbsp;diesen in das wei&szlig;e Feld einf&uuml;gst und auf &quot;Vorteilscode einl&ouml;sen&quot; klickst, wird dir dein Rabatt ganz einfach angerechnet.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/2%20gross(1).png\" style=\"width: 745px; height: 437px;\" /></p>\r\n\r\n<p>In den folgenden Schritten musst du lediglich noch deine Kontakt- und Versanddetails angeben, und dann steht deiner Lieferung nichts mehr im Weg! Spare auch beim n&auml;chsten Mal wieder mit Gutscheinen von Flipit!&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-23 19:52:59','2014-01-23 19:52:59'),(156,78,'1. Artikel dem Warenkorb hinzufÃ¼gen','<p>Nachdem du dein passendes Produkt ausgew&auml;hlt&nbsp;und mit den posterjack Bearbeitungs-Tools individuell gestaltet hast, f&uuml;ge deinen Artikel dem Warenkorb hinzu. Klicke dazu den&nbsp;&quot;In den Warenkorb&quot;-Button.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/how%20to%201%20gro%C3%9F.png\" style=\"width: 745px; height: 524px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-23 20:52:52','2014-01-23 20:52:52'),(157,78,'2. FÃ¼ge den Gutscheincode ein','<p>Im n&auml;chsten Schritt siehst du noch einmal eine genaue &Uuml;bersicht von&nbsp;deinen ausgew&auml;hlten Produkt. Wenn du alles noch einmal&nbsp;&uuml;berpr&uuml;ft hast und mit deiner Auswahl zufrieden bist, kannst du jetzt deinen Gutscheincode von der&nbsp;Flipit-Seite kopieren und im unten aufgef&uuml;hrten Gutschein-Feld einf&uuml;gen. Klicke anschlie&szlig;end auf &quot;Einl&ouml;sen&quot;.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/gro%C3%9F%202.png\" style=\"width: 1016px; height: 460px;\" /></p>\r\n\r\n<p>Und damit hast du es eigentlich schon geschafft. Vervollst&auml;ndige nun deine Sendung, indem du die restlichen erforderlichen Schritte wie Adressen- und Zahlungsdetails angibst, und dann dauert es auch nicht mehr lang bis dein Artikel von posterjack bei dir landet.</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-23 20:52:52','2014-01-23 20:52:52'),(165,36,'1. Artikel auswÃ¤hlen','<p>Nachdem du einen passenden&nbsp;Artikel gefunden und ihn im anschlie&szlig;enden Schritt mit deinen eigenen&nbsp;Fotomotiven versehen hast, f&uuml;ge ihn deinem Warenkorb hinzu. Hierzu klickst du auf den entsprechenden orangen Button.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/neu%201%20gross.png\" style=\"width: 745px; height: 460px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-23 22:10:59','2014-01-23 22:10:59'),(166,36,'2. Gutscheincode einfÃ¼gen','<p>Schon im n&auml;chsten Schritt wirst du aufgefordert, deinen Gutscheincode in das unten stehende Feld einzuf&uuml;gen. Wenn du das getan hast, klicke auf &quot;Einl&ouml;sen&quot;.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/new2%20gross.png\" style=\"width: 750px; height: 279px;\" /></p>\r\n\r\n<p>Jetzt musst du nur noch deine Lieferung vervollst&auml;ndigen, indem du deine Adresse, Zahlungsdetails etc. angibst und schon steht deiner Bestellung nichts mehr im Weg!&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-23 22:10:59','2014-01-23 22:10:59'),(173,13,'1. Die gewÃ¼nschten Artikel in den Warenkorb legen','<p>Im ersten Schritt werden alle gew&uuml;nschten Artikel in den Warenkorb gelegt unter der Angabte von St&uuml;ckzahl, gegebenenfalls Farbe und Gr&ouml;&szlig;e.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/neckermann1(1).png\" style=\"width: 745px; height: 98px;\" />​</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-24 16:06:51','2014-01-24 16:06:51'),(174,13,'2. Kontrolle der Artikel im Warenkorb','<p>Nun k&ouml;nnen im Warenkorb noch einmal alle Artikel eingesehen werden und auf ihre Richtigkeit &uuml;berpr&uuml;ft. Sollte ein Artikel nicht bestellt werden oder stimmt Farbe, St&uuml;ckzahl oder de Gr&ouml;&szlig;e nicht, dann hast du nun die Gelegenheit dies noch einmal zu korrigieren.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/neckermann2(1).png\" style=\"width: 745px; height: 385px;\" />​</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-24 16:06:51','2014-01-24 16:06:51'),(175,13,'3. Eingabe des Gutscheincodes und Abschicken der Bestellung','<p>Im letzten Bestellschritt kann nun der Neckermann Gutscheincode eingegeben werden und nachdem die Bezahlmethode eingegeben ist, kann nun die Bestellung abgeschickt werden. Der Rabatt durch den Gutscheincode wird auch gleich angezeigt.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/neckermann3(1).png\" style=\"width: 745px; height: 135px;\" />​</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-24 16:06:51','2014-01-24 16:06:51'),(189,82,'1. FÃ¼ge deinen Lieblingsartikel dem Warenkorb hinzu','<p>Nachem du etwas passendes gefunden hast w&auml;hle dann&nbsp;den Artikel aus, f&uuml;ge dann die entsprechende Gr&ouml;&szlig;e&nbsp;hinzu und klicke anschlie&szlig;end auf &quot;In den Warenkorb&quot;.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/how%20to%201%20copy.png\" style=\"width: 745px; height: 457px;\" /></p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-27 14:52:09','2014-01-27 14:52:09'),(190,82,'2. Warenkorb ansehen und Gutscheincode einfÃ¼gen','<p>Wenn du nun mit Shoppen fertig bist, klicke auf den Warenkorb, den du immer im rechten oberen Bildschirmrand findest. Hier&nbsp;findest&nbsp;du alle deine ausgew&auml;hlten Artikel im &Uuml;berblick. Auf derselben Seite wirst du weiter unten nun auch schon nach deinem pers&ouml;nlichen Geschenke- oder Gutscheincode gefragt, den du dann im&nbsp;nebenstehenden Feld direkt einf&uuml;gen kannst.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/how%20to%202%20copy.png\" style=\"width: 745px; height: 362px;\" /></p>\r\n\r\n<p>Und das war es eigentlich auch schon. Vervollst&auml;dige nun deine Bestellung, indem du deine Adresse, Zahlungsdetails, etc. angiebst und best&auml;tige den Kauf. Nun musst du nicht mehr lange auf deinen Einkauf warten und hast dabei auch noch satte Rabatte kassiert! Gl&uuml;ckwunsch!</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-27 14:52:09','2014-01-27 14:52:09'),(196,104,'1. Artikel auswÃ¤hlen','<p>Nachdem du eine passende Vorlage f&uuml;r deine Karte im bonnyprints-Sortiment ausgew&auml;hlt hast, wird diese im n&auml;chsten Schritt von dir ganz pers&ouml;nlich gestaltet. Lade hierzu ein entsprechende Bild hoch, das auf deiner Einladung erscheinen soll und ver&auml;ndere wenn n&ouml;tig Text, Schriftart und Schriftgr&ouml;&szlig;e. Im n&auml;chsten Schritt wirst du gebeten einen entsprechenden Briefumschlag plus Adressaufkleber hinzuzuf&uuml;gen, wie du im unteren Bild sehen kannst. Wenn du dies getan hast, klicke auf &quot;Zum Warenkorb&quot;.</p>\r\n\r\n<p>&nbsp;<img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/gross%201.png\" style=\"width: 745px; height: 414px;\" /></p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-27 15:39:02','2014-01-27 15:39:02'),(197,104,'2. Gutscheincode einfÃ¼gen','<p>Im n&auml;chsten Schritt kannst du deine Bestellung dann nochmals auf ihre Richtigkeit hin &uuml;berpr&uuml;fen. Wenn alles stimmt und du mit deiner Auswahl zufrieden bist, siehst du weiter unten auf der Seite ein Feld mit der &Uuml;berschrift &quot;Haben Sie einen Gutschein?&quot; Die Antwort ist nat&uuml;rlich <i> JA </i>: Denn genau hier f&uuml;gst du deinen Gutscheincode ein, den du zuvor von der Flipit-Seite kopiert hast. Wenn du das getan hast klicke auf &quot;Einl&ouml;sen&quot;.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/gross2.png\" style=\"width: 745px; height: 377px;\" /></p>\r\n\r\n<p>Nun folgen nur noch ein paar wenige Schritte bez&uuml;glich deiner Adress- und Zahlungsdetails, und schon steht deiner Bestellung nichts mehr im Wege!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-27 15:39:02','2014-01-27 15:39:02'),(219,11,'1. WÃ¤hle deinen Artikel','<p>Nachdem du ein sch&ouml;nes Kleidungsst&uuml;ck gefunden hast, klicke&nbsp;darauf, um die <strong>Detail&uuml;bersicht</strong> des Artikels&nbsp;aufzurufen. Diese k&ouml;nnte so aussehen:</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/1%20gross(3).png\" style=\"width: 745px; height: 389px;\" /></p>\r\n\r\n<p>Hier wirst du dann aufgefordert Gr&ouml;&szlig;e und gegebenenfalls&nbsp;Farbe deines Kleidungsst&uuml;ckes genauer zu bestimmen. Wenn du das gemacht hast und mit deiner Auswahl zufrieden bist, <strong>klicke auf &ldquo;in den Warenkorb legen&rdquo;</strong>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-28 14:33:29','2014-01-28 14:33:29'),(220,11,'2. PrÃ¼fe deinen Warenkorb','<p>Danach wird sich ein Fenster &ouml;ffnen, in dem du entweder &quot;zum Warenkorb&quot; oder &quot;zur&uuml;ck zum Artikel&quot; klicken kannst. Wenn du noch weitershoppen willst, klicke &quot;zur&uuml;ck zum Artikel&quot; und suche nach weiten Angeboten. Wenn du der Meinung bist, du hast genug geshoppt, solltest du deine <strong>Artikel noch mal in der &Uuml;bersicht vom Warenkorb &uuml;berpr&uuml;fen</strong>. Dazu kannst du jederzeit <strong>rechts oben auf der Website auf &quot;Warenkorb&quot;</strong> (neben dem Einkaufswagensymbol) klicken. Dein Warenkorb k&ouml;nnte dann so aussehen:</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/2%20gross(3).png\" style=\"width: 745px; height: 451px;\" /></p>\r\n\r\n<p>Hast du deine Artikel nochmal auf ihre Richtigkeit hin &uuml;berpr&uuml;ft,<strong> klicke auf &quot;Weiter&quot;</strong>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-28 14:33:29','2014-01-28 14:33:29'),(221,11,'3. FÃ¼ge deinen Gutscheincode ein','<p>In&nbsp;den folgenden Schritten, Schritt 2 &quot;Anmeldung&quot; und Schritt 3 &quot;Lieferung &amp; Zahlung&quot;, wirst du aufgefordert deine pers&ouml;nlichen Daten, wie Lieferadresse und Zahlungsdetails, anzugeben.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/3%20gross(2).png\" style=\"width: 745px; height: 530px;\" /></p>\r\n\r\n<p>Erst auf der&nbsp;allerletzten Seite, unter Schritt 4 &quot;Pr&uuml;fen &amp; Bestellen&quot;, wirst du dann <strong>nach deinem Gutscheincode gefragt</strong>. Jetzt ist es an der Zeit, diesen von der Flipit-Seite zu kopieren und ihn das <strong>wei&szlig;e Vorteils-Nummern-Feld einzuf&uuml;gen</strong>. Dieses findest du auf derselben Seite weiter unten im Bild mit dem gelb hinterlegten Hintergrund (siehe Bild). Und das war&#39;s auch schon, jetzt musst du nur noch auf<strong> &quot;Bestellung abschicken&quot; klicken</strong> und schon steht deiner Lieferung nichts mehr im Wege.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-28 14:33:29','2014-01-28 14:33:29'),(227,51,'1. WÃ¤hle deinen Lieblingsartikel','<p>Wenn du erst einmal einen Artikel gefunden hast, der dir gef&auml;llt, und du dich entschlie&szlig;t diesen zu kaufen, klicke auf &quot;In the Einkaufstasche&quot;. Damit landet dein Schuh&nbsp;im Warenkorb.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/adidas%201%20copy.png\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-28 18:37:40','2014-01-28 18:37:40'),(228,51,'2. FÃ¼ge deinen Gutscheincode ein','<p>Wenn du dir dann deine Einkaufstasche ansiehst, wirst du direkt nach deinem Promotionscode gefragt. Das Feld hierzu siehst du in der linken unteren Ecke. Dort f&uuml;gst du dann einfach den Rabattcode ein, den du dir zuvor auf Flipit.com kopiert hast.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/adidas%202%20logo%20copy.png\" style=\"width: 745px; height: 350px;\" /></p>\r\n\r\n<p>Wenn du jetzt auf &quot;Zur Kasse&quot; klickst, hast du es eigentlich schon geschafft. Einfach noch deine pers&ouml;nlichen Daten und Zahlungsdetails eingeben, und schon bist du fertig! Gl&uuml;ckwunsch zum neuen Schn&auml;ppchen, dank deinem Gutscheincode!l;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-28 18:37:40','2014-01-28 18:37:40'),(229,8,'1.WÃ¤hle Artikel aus und lege sie in die Einkaufstasche','<p>Wenn du den Onlineshop Bonprix besuchst, kannst du jegliche Artikel mit einem Klick in deine Einkaufstasche legen, die du gerne bestellen m&ouml;chtest. W&auml;hle dabei immer die Gr&ouml;&szlig;e, Farbe und St&uuml;ckzahl aus. Sobald du alle Artikel gefunden hast, die du bestellen m&ouml;chtest, kannst du nun auf die Einkaufstasche gehen und alle Artikel einsehen.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/bonprix1.png\" style=\"width: 745px; height: 94px;\" /></p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-28 19:13:55','2014-01-28 19:13:55'),(230,8,'2. Einkaufstasche Ã¼berprÃ¼fen und bestellen','<p>In der Einkaufstasche bekommst du nun eine &Uuml;bersicht der von dir gew&auml;hlten Artikel. Hier kannst du noch einmal alle Produkte &uuml;berpr&uuml;fen und schauen, ob Gr&ouml;&szlig;e, St&uuml;ckzahl und gegebenenfalls Farbe korrekt sind. Ebenfalls kannst du sehen, ob der gew&uuml;nschte Artikel derzeit lieferbar ist, oder ob du dich gegebenenfalls gedulden musst. Im unteren Abschnitt kannst du nun ebenfalls deine Bonprix Aktionsnummer eingeben und deinen Rabatt einl&ouml;sen.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/bonprix2.png\" style=\"width: 745px; height: 503px;\" /></p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-28 19:13:55','2014-01-28 19:13:55'),(231,8,'3. Anmelden und Bestellung absenden','<p>Im letzten Schritt meldest du dich an oder loggst dich an, falls du schon ein Mitglied bei Bonprix bist. Gib im folgenden Schritt deine Liefer- und Bezahlw&uuml;nsche an und&nbsp;dann kannst du deine Bestellung bei Bonprix abschicken.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/bonprix3.png\" style=\"width: 743px; height: 458px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n','2014-01-28 19:13:55','2014-01-28 19:13:55'),(232,70,'1. WÃ¤hle deinen gewÃ¼nschten Artikel aus','<p>Beginne mit dem Shoppen, indem du auf www.sony.at die aktuellen Online-Produkte durchst&ouml;berst. Wenn du etwas Passendes gefunden hast, w&auml;hle den entsprechenden Artikel aus und klicke dann auf &quot;Online kaufen&quot;.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/sony1%20klein(1).png\" style=\"width: 745px; height: 389px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-28 19:44:15','2014-01-28 19:44:15'),(233,70,'2. FÃ¼ge deinen Gutschein ein','<p>Im n&auml;chsten Schritt wird dir von Sony nochmals eine Bestell&uuml;bersicht angezeigt. Wenn du auf dieser Seite runterscrollst, wirst du bereits aufgefordert deinen Code f&uuml;r den&nbsp;Gutschein anzugeben. Diesen kopierst du wie immer ganz einfach von deiner Flipit-Seite und f&uuml;gst ihn ein.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/sony2%20klein.png\" style=\"width: 745px; height: 487px;\" /></p>\r\n\r\n<p>Best&auml;tige das Ganze, indem du dann auf &quot;Gutschein einl&ouml;sen klickst und dann auf das rote Feld &quot;JETZT zur Kasse!&quot; im rechten oberen Bildschirmrand. Und das war&#39;s eigentlich schon, wenn du jetzt noch deine pers&ouml;nlichen Daten wie Name, Lieferadresse, etc. ausf&uuml;llst, steht der Lieferung deines Sony-Artikels nichts mehr im Wege! Bis zum n&auml;chsten Einkauf, wo dir&nbsp;Flipit hoffentlich auch wieder beim Sparen helfen wird!</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-28 19:44:15','2014-01-28 19:44:15'),(234,88,'1. Suche nach dem Event deiner Wahl','<p>Suche auf www.viagogo.at nach deiner Lieblingsband oder deinem n&auml;chsten Event. Wenn du das passende gefunden hast, dann klicke auf&nbsp;&nbsp;&quot;Ansehen&quot;.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/viagogo%20copy.png\" style=\"width: 745px; height: 277px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-28 20:07:13','2014-01-28 20:07:13'),(235,88,'2. Finde den besten Preis fÃ¼r dein Event','<p>Nachdem du dich f&uuml;r eine Veranstaltung entschieden hast, halte Ausschau nach dem besten Preis und best&auml;tige dann mit &quot;Kaufen&quot;.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/viagogo1%20copy.png\" style=\"width: 745px; height: 299px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-28 20:07:13','2014-01-28 20:07:13'),(236,88,'3. Gutschein einfÃ¼gen','<p>Nachdem du die Informationen zu deinem&nbsp;Event nochmal auf ihre Richtigkeit hin &uuml;berpr&uuml;ft hast, wirst du dann weiter unten auf der Seite nach deinem individuellen Rabattcode gefragt. Hier f&uuml;gst du dann ganz einfach den Code ein, den du&nbsp;auf Flipit erh&auml;ltst.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/viagogo2%20copy.png\" style=\"width: 745px; height: 347px;\" /></p>\r\n\r\n<p>Jetzt folgen noch zwei weitere Schritte betreffend der&nbsp;Zahlungsinformationen und Best&auml;tigung, und dann bist du fertig! Du hast es geschafft, Gl&uuml;ckwunsch zu deinem neuen Schn&auml;ppchen! Das war doch easy, oder?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-28 20:07:13','2014-01-28 20:07:13'),(241,14,'1. WÃ¤hle deinen Artikel aus','<p>Hast du ein Produkt gefunden, das&nbsp;dir zusagt, klicke darauf, um die Gro&szlig;ansicht aufzurufen. Dies sieht dann ungef&auml;hr so aus:</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/gross%201(1).png\" style=\"width: 961px; height: 518px;\" /></p>\r\n\r\n<p>Wenn du nun auf <strong>&quot;In den Warenkorb&quot;</strong> klickst, wird dein Artikel dem Warenkorb hinzugef&uuml;gt. Gleichzeitig&nbsp;&ouml;ffnet sich&nbsp;ein Fenster, in dem du entweder &quot;Weiter einkaufen&quot; oder &quot;Warenkorb/Kasse&quot; ausw&auml;hlen kannst. Wenn du mit deinem Einkauf zufrieden bist,<strong>&nbsp;klicke auf &quot;Warenkorb/Kasse&quot;</strong>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-30 18:32:54','2014-01-30 18:32:54'),(242,14,'2. FÃ¼ge deinen Gutscheincode ein','<p>Im n&auml;chsten Schritt wirfst du am besten noch einmal einen genauen Blick auf deinen Warenkorb und die ausgew&auml;hlten Artikel darin. Ist alles in Ordnung, kannst du auf derselben Seite weiter unten auch schon <strong>deinen Gutscheincode einf&uuml;gen</strong>. Diesen kopierst du zuvor von der Flipit Website. Klicke dann auf <strong>&quot;einl&ouml;sen&quot;</strong>.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/2%20gross(4).png\" style=\"width: 972px; height: 705px;\" /></p>\r\n\r\n<p>Und das war&#39;s eigentlich auch schon. Folge nun den weiteren Anweisungen in Schritt 2 - 5 und wenn du am Ende deine Bestellung absendest, kannst du dir sicher sein, clever gespart zu haben. Gl&uuml;ckwunsch!</p>\r\n','2014-01-30 18:32:54','2014-01-30 18:32:54'),(243,73,'1. WÃ¤hle dein Erlebnisgeschenk','<p>Nachdem du das passende Erlebnis f&uuml;r deine Liebsten und dich gefunden hast, klicke auf den Button <strong>&quot;In den Warenkorb&quot;</strong>. Daraufhin wirst du automatisch zum Warenkorb weitergeleitet.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/1%20gross.png\" style=\"width: 745px; height: 222px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-31 19:41:56','2014-01-31 19:41:56'),(244,73,'2. Wertgutschein-Feld Ã¶ffnen','<p>Auf der folgenden Seite hast du die M&ouml;glichkeit deine Bestellung nochmals zu &uuml;berpr&uuml;fen. Wenn alles so weit stimmt, siehst du auf derselben Seite weiter unten eine &Uuml;berschrift <strong>&quot;Wertgutschein / Rabattgutschein anrechnen&quot;</strong>. Das ist das Feld, das du brauchst! Klicke deswegen auf das darunterstehende K&auml;stchen &quot;Hier eingeben&quot;.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/2%20gross.png\" style=\"width: 745px; height: 258px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-31 19:41:56','2014-01-31 19:41:56'),(245,73,'3. Gutschein einfÃ¼gen','<p><strong>​</strong>Hast du <em>Schritt 2</em> befolgt, &ouml;ffnen&nbsp;sich nun zwei weitere Felder. Das untere Feld <strong>&quot;Erlebnisjoker (Rabattgutschein)&quot;</strong> ist das, wo du deine Rabatt-Nummer einf&uuml;gen musst!&nbsp;Jetzt kopierst&nbsp;du diesen von der Flipit-Seite. Hier wirst du feststellen, dass der Code durch einen Bindestrich unterteilt ist. F&uuml;ge den Teil <strong>vor</strong> dem Bindestrich in das erste, gr&ouml;&szlig;ere, und die Zahlen <strong>nach</strong>&nbsp;dem Bindesprich in das zweite, kleinere Feld ein. Klicke dann auf &quot;Wert anrechnen&quot;.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/3%20gross.png\" style=\"width: 745px; height: 384px;\" /></p>\r\n\r\n<p>Und das war&#39;s schon! Es ist gar nicht so kompliziert wie es sich anh&ouml;rt! Jetzt musst du nur noch deine Bestellung vervollst&auml;ndigen, indem du auf &quot;Bestellung fortsetzen&quot; klickst und schon steht deinem Jollydays Erlebnis nichts mehr im Weg!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-01-31 19:41:56','2014-01-31 19:41:56'),(254,34,'1. Ware dem Warenkorb hinzufÃ¼gen','<p>Hast du etwas passendes gefunden, f&uuml;ge deinen Artikel dem Warenkorb hinzu. Dies machst du, indem du auf &quot;In den Warenkorb&quot; klickst.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/1%20gross(5).png\" style=\"width: 745px; height: 403px;\" /></p>\r\n\r\n<p>Im n&auml;chsten Schritt bekommst du nochmals eine Best&auml;tigung und kannst dich entscheiden, ob du entweder weiter einkaufen, oder zum Warenkorb gehen willst.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-02-04 20:25:05','2014-02-04 20:25:05'),(255,34,'2. Gutscheincode einfÃ¼gen','<p>Hast du erst einmal genug geshoppt solltest du&nbsp;deinen&nbsp;Warenkorb aufrufen. Hier siehst du nochmal eine &Uuml;bersicht deiner Produkte. Bist du mit deiner Auswahl zufrieden, siehst du ein wenig weiter unten auf deselben Seite ein kleies gr&uuml;nes K&auml;stchen mit einem Plus neben der &Uuml;berschrift &quot;Gutschein einl&ouml;sen&quot;. Jetzt &ouml;ffnet sich ein Feld mit einem&nbsp;wei&szlig;en&nbsp;K&auml;stchen, wo du deinen Code von Flipit&nbsp;einf&uuml;gen musst. Klicke anschlie&szlig;end auf &quot;Einl&ouml;sen&quot;.</p>\r\n\r\n<p>&nbsp;<img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/2%20gross(6).png\" style=\"width: 745px; height: 344px;\" /></p>\r\n\r\n<p>Und was war&#39;s eigentlich schon. Nun musst du nur noch auf &quot;Zur Kasse&quot; klicken und in ein paar letzten Schritten deine Lieferadresse und Zahlungsdetails angeben. Und das war&#39;s auch schon. Herzlichen Gl&uuml;ckwunsch zu ihrem Schn&auml;ppchen!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-02-04 20:25:05','2014-02-04 20:25:05'),(258,6,'1. Artikel auswÃ¤hlen','<p>Wenn du deinen Artikel gefunden hast den du kaufen m&ouml;chtest, klicke auf &quot;In den Warenkorb&quot;.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/1%20gorss.png\" style=\"width: 745px; height: 387px;\" /></p>\r\n\r\n<p>Danach &ouml;ffnet sich ein Fenster,&nbsp;in dem du entweder &quot;Weiter einkaufen&quot; oder &quot;Zum Warenkorb&quot; ausw&auml;hlen kannst, je nachdem was du als n&auml;chstes tun willst.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-02-04 20:27:22','2014-02-04 20:27:22'),(259,6,'2. FÃ¼ge deinen Gutscheincode ein','<p>Wenn du&nbsp;nachdem du fertig geshoppt hast, zu deinem Warenkorb gehst, kannst du dort deine Artikel&nbsp;nochmals &uuml;berpr&uuml;fen. Bist du mit deiner Auswahl zufrieden, siehst du weiter unten auf derselben Seite auch schon das Feld f&uuml;r deinen Gutscheincode. Kopiere nun in das wei&szlig;e,leer K&auml;stchen deinen Flipit Gutscheincode und klicke auf &quot;einl&ouml;sen&quot;.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/2%20gross(7).png\" style=\"width: 745px; height: 399px;\" /></p>\r\n\r\n<p>Und was war&#39;s eigentlich auch schon. Wenn du jetzt auf &quot;Zur Kasse&quot; klickst, musst du nur noch in ein paar wenigen Schritten deine Details zu Adresse und Zahlung angeben, und schon steht deiner Lieferung nichts mehr im Wege!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-02-04 20:27:22','2014-02-04 20:27:22'),(260,2,'1. So lÃ¶st du den Zalando Gutscheincode ein','<p>Suche dir auf der Zalando Webseite www.zalando.at aus, was du kaufen m&ouml;chtest und f&uuml;ge den oder die Artikel deinem Warenkorb hinzu.</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/1zalando.png\" style=\"width: 745px; height: 121px;\" /></p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-02-05 21:46:26','2014-02-05 21:46:26'),(261,2,'2. ÃœberprÃ¼fe den Warenkorb und melde dich dann an','<p>Sobald du alle Artikel, die du kaufen m&ouml;chtest, im Warenkorb abgelegt hast, solltest du diesen noch einmal &uuml;berpr&uuml;fen. Dort wird dir auch angezeigt, dass du deinen Gutscheincode im letzten Bestellschritt angeben kannst. Vorher pr&uuml;fe deinen Einkauf noch einmal.&nbsp;Sind wirklich nur die Artikel im Warenkorb, die du haben m&ouml;chtest?&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/2zalando.png\" style=\"width: 745px; height: 334px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Wenn du die Frage mit &#39;Ja&#39; beantworten kannst, dann kannst du zur Kasse durchgehen. Hierf&uuml;r kannst du dich, entweder als Neukunde anmelden, oder dich mit einem bereits existierenden Kundenkonot anmelden.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/zalando3.png\" style=\"width: 745px; height: 340px;\" /></p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-02-05 21:46:26','2014-02-05 21:46:26'),(262,2,'3. Jetzt kannst du deinen Gutscheincode angeben','<p>Nach der erfolgreichen Anmeldung als Neukunde oder Bestandskunde&nbsp;&uuml;berpr&uuml;fst du noch einmal deine Adresse. Stimmt diese, dann kannst du im n&auml;chsten Schritt deinen Gutscheincode in dem daf&uuml;r vorgesehenen Feld angeben. Nach Eingabe des Gutscheins, klickst du auf &quot;weiter&quot; um den Code zu best&auml;tigen. Der Rabatt wird dir daraufhin abgezogen und du kannst den Einkauf abschlie&szlig;en.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/public/at/images/upload/ckeditor/images/zalando4.png\" style=\"width: 745px; height: 340px;\" /></p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n','2014-02-05 21:46:26','2014-02-05 21:46:26');
